INSERT INTO `announcement` VALUES (34,200031010011,'开放实验立项操作流程','<h3>1. 指导老师拟题，指导老师填写拟题申请表，在\"是否开放选题\"一栏设置项目开放性，如果选择不公开或部分公开，则可以指定添加学生，提交申请后在\"已报项目\"栏可以查看已申请的项目，在\"成员审批\"栏可以审批已申请项目的学生，可以添加、删除成员、设置项目组长。</h3><h3>2. 实验室拟题审核，由实验室主任审核拟题项目 (拟题审核后不可修改项目申请书)</h3><h3>3. 开放选题项目公开选题，拟题审批后，所有开放性为公开或者部分公开的项目进行公示，通知学生进行选择(拟题审核后老师不可添加成员，可以提醒学生在首页或者“项目申请”栏进行申请，然后由指导老师审核加入)</h3><h3>4. 老师审批学生申请，设置项目组长</h3><h3>5. 重点项目组长下载重点申请书模板，填写并上传重点项目立项申请正文，可修改后重新上传，确定后无误后点击提交重点申请</h3><h3>6. 指导老师审批重点项目申请书，可以驳回申请让项目组长修改重点申请书</h3><h3>7. 实验室主任进行立项审核</h3><h3>8. 学院分管副院长审核上报学校</h3><p><br></p><p><span style=\"color: rgb(0, 0, 0);\"><img src=\"http://119.23.29.240/file/%E7%AB%8B%E9%A1%B9%E6%B5%81%E7%A8%8B.png\" width=\"700px\"></span></p>','2019-12-11 14:13:28','2019-12-15 15:50:17',1,NULL),(38,201731000000,'关于重点项目文件提交','<p><strong>1.重点项目申请书只需要填写正文部分，其余部分由系统自动生成，组长无需再次填写表格部分。</strong></p><p><strong>2.文档目前只支持word2003版，请依照重点项目申请书标准。</strong></p><p><br></p><p><strong>如遇问题或者反馈bug，请联系开发人员 qq:792559738</strong></p>','2019-12-25 21:37:19','2019-12-25 21:37:19',1,NULL);
/*!40000 ALTER TABLE `announcement` ENABLE KEYS */;
UNLOCK TABLES;

