  `start_time` datetime DEFAULT NULL COMMENT '实验开始时间',
  `address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '实验地点',
  `suggest_group_type` smallint(2) DEFAULT NULL COMMENT '建议评分分组:.A组石工地堪,.B组化工材料.C组机械力学.E组软件与数学,.F组经管法律艺体人文',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `is_open_topic` smallint(2) unsigned NOT NULL COMMENT '是否开放选题  1.是,2否,3,开放部分',
  `main_Content` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主要内容',
  `subordinate_college` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '项目所属的学院',
