INSERT INTO `project_group` VALUES (4,'','2019KSZ06001',1,2,200831010050,'2020-11-01 00:00:00',3000,'计算机综合实验教学中心',4,'软著一套\n开发报告一份',NULL,NULL,NULL,3,600,'服务器 台式机','基于区块链的物品捐赠溯源系统','2019-12-09 11:29:48','2019-12-05 00:00:00','明理楼B区',4,'2019-12-11 08:47:58',2,'本项目与校青志协等志愿服务组织以及专门的物品回收公司收衣先生合作，采用两种方式：一、通过线上申请发起捐赠，专人上门回收，从而达到随时随地方便回收，打破传统捐赠的不便之处。二、志愿组织在专门的时间地点进行物品回收，并在平台上发布相应信息。\n对于捐赠的物资，采用区块链分布式记账系统，通过对捐赠物品设置唯一标识信息从物品捐赠人、转手的捐赠点到最后的获赠人每个环节记录信息上传到区块链以类似物流信息的样式实时反馈。利用区块链的不可篡改分布式存储的特性，确保捐赠物资的流通环节和去向公开透明，从而保证物资确实用到了实处和需要的人手中。','6'),(5,'','2019KSZ06002',-4,2,200831010050,'2020-11-01 00:00:00',3000,'计算机综合实验教学中心',4,'软著一份 开发报告一份',NULL,NULL,NULL,3,800,'服务器，台式机','基于区块链的物品捐赠溯源系统','2019-12-09 11:34:45','2019-12-05 00:00:00','明理楼B区',4,'2019-12-11 08:47:12',2,'本项目与校青志协等志愿服务组织以及专门的物品回收公司收衣先生合作，采用两种方式：一、通过线上申请发起捐赠，专人上门回收，从而达到随时随地方便回收，打破传统捐赠的不便之处。二、志愿组织在专门的时间地点进行物品回收，并在平台上发布相应信息。\n对于捐赠的物资，采用区块链分布式记账系统，通过对捐赠物品设置唯一标识信息从物品捐赠人、转手的捐赠点到最后的获赠人每个环节记录信息上传到区块链以类似物流信息的样式实时反馈。利用区块链的不可篡改分布式存储的特性，确保捐赠物资的流通环节和去向公开透明，从而保证物资确实用到了实处和需要的人手中。','6'),(7,'2019KSP06001','2019KSZ06003',4,1,200331010042,'2020-06-01 00:00:00',500,'计算机综合实验教学中心',4,'源代码、程序演示','[\"6\"]','[\"24\",\"25\",\"26\",\"27\"]','[2017,2018,2019]',3,400,'1.	装有Ubuntu系统或装有Ubuntu虚拟机的PC机一台\n2.	凌阳A8嵌入式实验箱一台\n3.	S5PV210CPU板模块，LCD模块\n','触摸屏驱动开发实验','2019-12-09 16:55:56','2019-12-05 00:00:00','明理楼4楼',4,'2019-12-25 10:38:46',1,'触摸屏作为一种电脑输入设备，它是目前最简单、方便、自然的一种人机交互方式。通过本项目的研究使学生掌握电阻式触摸屏的工作原理和S5PV210的触摸屏驱动的开发方法。','6'),(8,'2019KSP06002','2019KSZ06004',4,1,200331010042,'2020-06-01 00:00:00',500,'计算机综合实验教学中心',4,'源代码、程序演示\n','[\"6\"]','[\"24\",\"25\",\"26\",\"27\"]','[2017,2018,2019]',3,400,'1.	装有Ubuntu系统或装有Ubuntu虚拟机的PC机一台\n2.	凌阳A8嵌入式实验箱一台\n3.	S5PV210CPU板模块，以太网模块\n','网络驱动开发实验','2019-12-09 17:08:31','2019-12-05 00:00:00','明理楼4楼',4,'2019-12-25 10:38:46',1,'以太网是当今当今局域网中最通用的通信协议标准，该标准定义了在局域网中采用的电缆类型和信号处理方法。通过本项目的研究使学生掌握Linux下开发网络设备（DM9000）的驱动程序和框架，开发步骤，并在Linux下进行此设备驱动的测试。','6'),(19,'','2019KSZ06006',-4,2,200631010039,'2020-11-01 00:00:00',3000,'计算机科学学院机房',1,'学科竞赛省级三等奖以上三项或科研论文一篇及以上或外观设计专利一项或软件著作权一项',NULL,NULL,NULL,7,1050,'具有大数据Hadoop、Spark等大数据框架基础、市场调研能力、java编码能力、JavaScript、Echarts等前端技术等能力','基于交通时空大数据挖掘的实时路况信息系统研究','2019-12-10 09:37:44','2019-12-05 00:00:00','明理楼B413',4,'2019-12-11 08:47:12',2,'本系统设计是基于Hadoop分布式架构，整个架构的核心部分包括HDFS文件系统和Map Reduce并行计算变成接口，对道路交通各业务系统的数据抽取加载，并对原始交通数据的预处理技术进行研究，针对采集的原始交通数据的特征制定清洗规则，并且提出一种动态自适应的对交通数据进行修复的算法，从而搭建各个路况信息数据挖掘平台架构，并通过Echarts实时展示路况信息；整个过程就包括数据采集层、数据存储层、数据分析层和大数据应用层，最终从而方便人民根据具体的交通状态来选择合理的出行路线，从而避免交通拥堵带来的困扰，在交通管理等方面提供重大的参考价值。','6'),(31,'','2019KSZ06010',1,2,200731010048,'2020-11-01 00:00:00',5000,'图像处理与并行计算实验室',1,'公开发表论文1篇',NULL,NULL,NULL,3,7200,'具备GPU服务器、并行计算服务器等','基于彩色多普勒超声心动图左心室血流场可视化方法','2019-12-10 10:29:04','2019-12-05 00:00:00','明理楼B515',4,'2019-12-11 08:47:12',1,'心血管病成为目前重大的公共问题，心血管疾病的产生往往与心腔血液流动模式异常等密切联系。超声检测身体部位时具有实时、便捷、价格低廉等优点，是诊断心脏疾病常用的成像急速。基于此，我们使用彩色多普勒超声心动图，根据质量守恒定律结合流体力学中连续性方程，对心脏左心室的血流模式进行研究，研究结果用以作为心脏疾病判断治疗的重要参考。','6'),(32,'','2019KSZ06011',1,2,200731010048,'2020-11-01 00:00:00',5000,'图像处理与并行计算实验室',1,'公开发表论文1篇',NULL,NULL,NULL,3,7200,'GPU服务器、并行计算服务器，会并行领域的博士','基于三维光线追踪的实时超声图像模拟','2019-12-10 10:30:05','2019-12-05 00:00:00','明理楼B515',4,'2019-12-11 08:47:12',1,'由于超声进行身体部位的检测时具备高效，实时，对人体无害等特点，在医学领域具有很大的潜力。在超声医师入职的时候会经过培训才能够准确的认识各种病变，但由于没有随时可提供的志愿者来让医师来锻炼如何正确的使用超声探头以及病变的认识，因此我们提出一种基于光线追踪的方式模拟超声成像，使入职医师不需要志愿者且随时随地都可以进行超声探头操作以及身体病变部位的认识。','6'),(33,'','2019KSZ06012',-4,2,200731010048,'2020-11-01 00:00:00',5000,'图像处理与并行计算实验室',1,'公开发表论文1篇',NULL,NULL,NULL,3,7200,'GPU服务器、并行计算服务器','基于超声的局部脉搏波速度的测量方法研究及应用','2019-12-10 10:32:56','2019-12-05 00:00:00','明理楼B515',4,'2019-12-11 08:47:12',1,'脉搏波速度（PWV）是一个评价动脉硬化的指标，它可以预测心脑血管事件。目前，PWV是通过“foot-to-foot”的方法，它给出的是一个全局的PWV，无法可靠的估计局部动脉的硬化情况。超声是无侵害的一种检测模式，不像核磁共振等具有辐射性。这里我们使用超声采集局部动脉的M模式和脉冲多普勒图像，进而得到直径波形和血流速度波形，将直径波形与血流速度波形配对，利用ln(D)U-loop法计算出当前测量动脉段的局部PWV。','6'),(34,'','2019KSZ06013',-4,2,200131010015,'2020-11-01 00:00:00',5000,'大数据与知识工程实验室',4,'论文、学科竞赛获奖',NULL,NULL,NULL,6,1500,'SqlServer,Java,Python,机器学习','钻井作业生产安全监管智能预警系统','2019-12-10 10:34:41','2019-12-05 00:00:00','明理楼B511',4,'2019-12-11 08:47:12',1,'建立生产安全监管智能预警系统，实行安全监督的网络化管理，实现信息共享，及时、准确了解作业现场安全现状，为管理者提供实时、客观的决策依据，确保公司生产安全形势的根本性好转，实现与所属作业现场风险控制系统的风险控制状况的交换，做到直接、快速、准确获得作业现场的风险控制信息，对风险控制状况进行评估、下达风险控制指令。','6'),(35,'','2019KSZ06014',-4,2,200831010050,'2020-11-01 00:00:00',3000,'计算机综合实验教学中心',4,'软著一套，开发文档一份',NULL,NULL,NULL,3,800,'服务器，台式机','世纪之约','2019-12-10 10:35:35','2019-12-05 00:00:00','明理楼B区',4,'2019-12-11 08:47:12',2,'本项目基于区块链的安全性以及信息的不可篡改性，针对于我们平常生活中普普通通的人们，帮助他们记录下自己身边所爱的人带给他们的点点滴滴的感动；也许人脑会忘记一些记忆，会记错一些事情，但是区块链会帮助他们永远保存自己所经历的各种感动，而且不会改变消逝。\n用户对于一些很特殊的日子，可以两个人共同发布一则富有纪念意义的消息，亲朋好友可以对消息进行评论点赞，大家都能看到这一则消息，并且消息不会被篡改，留在人们脑海中的同时，也将永远保存在区块链网络上；等到特定的时间时，可以再次将封存的回忆拿来回味，重回记忆中的温暖，让回忆永不退色，让约定永远长存。\n项目最核心的部分，便是利用区块链的不可篡改性，来保存用户想要留下的珍贵的记忆，在以后的基础上实现家族的溯源，让每一个人都能了解家族的一段段故事。\n','6'),(36,'','2019KSZ06015',1,2,200731010048,'2020-11-01 00:00:00',5000,'图像处理与并行计算实验室',1,'公开发表论文1篇',NULL,NULL,NULL,3,7200,'GPU服务器、并行计算服务器','超声弹性成像全局应变估计算法的研究及应用','2019-12-10 10:56:48','2019-12-05 00:00:00','明理楼B515',4,'2019-12-11 08:47:12',1,'超声弹性成像技术的基本思想是从超声信号中获取生物组织的硬度信息并进行成像。超声弹性成像技术在疾病检测和诊断等临床实践中具有广阔的应用前景。生物组织的应变估计在超声弹性成像中扮演着举足轻重的角色。目前，大部分应变估计算法都是基于窗口的，例如互相关方法和仿射估计。然而，基于窗口的应变估计算法需要考虑窗口大小、窗口重叠和计算效率三个因素。而在Horn Schunk光流估计框架下，全局应变估计算法能够在不需要多窗口的情况下有效率地计算出全局应变。','6'),(37,'2019KSP06003','2019KSZ06016',4,1,200131010015,'2020-06-01 00:00:00',5000,'大数据与知识工程实验室',4,'软件著作权，学科竞赛等',NULL,NULL,NULL,6,1500,'开发工具是HBuilderX,Google Chrome  UI框架：ColorUI ，webpack，vue,sass等前端技术。\n后端：开发工具是idea,用到的技术是Spring boot、spring-data-jpa、shrio、Jsp、 Java Servlet等技术\n算法：graph-based等\n数据库：mysql+redis','“智”行游乐','2019-12-10 12:38:02','2019-12-05 00:00:00','明理楼B511',4,'2019-12-25 10:38:46',1,'结合互联网+，开发让用户“智”行游乐园的微信小程序，实现游乐场实时信息透明。基于大数据的分析，研究机器学习算法，实时监控游乐场设施排队现况，将现况呈现给用户。“并计算出最优游玩路线、根据用户所在定位，为用户推荐餐厅、商店等。让游客“智”行游乐园。','6'),(38,'2019KSP06004','2019KSZ06017',4,1,200131010015,'2020-06-01 00:00:00',5000,'大数据与知识工程实验室',4,'软件著作权、学科竞赛',NULL,NULL,NULL,6,1500,'H5游戏开发引擎，HTML5，APP','基于绿色出行场景个人碳排放积分系统开发与运营','2019-12-10 13:01:11','2019-12-05 00:00:00','明理楼B511',4,'2019-12-25 10:38:46',1,'与既有交通类app结合，基于公共出行场景，设计个人碳排放积分运营系统，对日常出行数据进行分析以及提取，将出行数据转换成碳积分，对公众实现对碳积分的了解与推广，帮助供应商找出并消除供应链中的“碳排放热点”，以此降低供应链的碳排放水平。系统主要包含功能：\n1）、在系统开发与运营中，实现对不同年龄阶段用户出行数据的分类整理，以完整的检测系统数据基础，充分利用自身软件功能，通过对不同的用户画像标签进行处理，以积分成就系统形式实现用户对碳积分的积攒并提高绿色出行的比率。\n2）、通过宠物养成系统增强公共出行软件的趣味性，充分利用使用者的责任感，以可与使用者进行交互的虚拟形象为中介，通过碳积分喂食等转换机制提高使用者对软件的粘着性、对软件的探索兴趣以及对碳积分的收集乐趣。\n3）、针对个人碳排放积分具有绿色环保属性，以及可交易流通的资产属性设计一套商业模式，为企业再碳积分的推广运营过程中再实现额外的商业价值。同时利用碳积分有效量化用户绿色出行贡献，转换为用户实际收益，利用出行软件自身数据真实性的优势，与商业交易结合，充分联系到使用者自身的利益上。','6'),(39,'2019KSP06005','2019KSZ06018',4,1,200131010015,'2020-06-01 00:00:00',5000,'大数据与知识工程实验室',4,'软件著作权、学科竞赛',NULL,NULL,NULL,6,1500,'H5 跨 端 混 合APP，微信小程序应用','基于公共出行场景的微信APP小游戏','2019-12-10 13:10:22','2019-12-05 00:00:00','明理楼B511',4,'2019-12-25 10:38:46',1,'打造一款实现紧密结合场景特点，具有场景特色、趣味性的 APP 内嵌小游戏。该小游戏健康、积极且具有完整流程的概念故事。在用户上不再局限于年轻男性，其中女性，中老年人以及中小城市市民成为十分重要的使用者。小游戏不再要求用户花费大量时间待在固定空间进行操作 ，而是在碎片化场景中为玩家提供娱乐方式。区别于传统网游中心化的入口方法 ，小游戏建立起了基于社交逻辑的分享入口 ，向去中心化的多对多传播方向发展。小游戏同样通过销售道具会员','6'),(40,'','2019KSZ06019',1,1,200131010015,'2020-06-01 00:00:00',500,'大数据与知识工程实验室',4,'软件作品',NULL,NULL,NULL,6,1000,'APP开发框架Android2013-2016nian','SWPU论坛APP','2019-12-10 13:16:53','2019-12-05 00:00:00','明理楼B511',4,'2019-12-11 08:46:15',1,'开发一款App用于校园中学生们的日常生活谈论，学习资源分享。便于不同专业、不同年级的学生之间进行交流。','6'),(41,'2019KSP06006','2019KSZ06020',4,1,200631010039,'2020-06-01 00:00:00',500,'计算机科学学院机房',4,'安全帽动态检测系统或学科竞赛省级三等奖及以上一项或软件著作权一项',NULL,NULL,NULL,5,1050,'具有大数据Hadoop、Spark等大数据框架基础、市场调研能力、java编码能力、JavaScript、Echarts等前端技术等能力以及python深度学习','智慧工地安全帽动态检测方法研究与实现','2019-12-10 15:30:03','2019-12-05 00:00:00','明理楼B413',4,'2019-12-25 10:38:46',2,'本系统设计是基于卷积神经网络和迁移学习，针对于工作人员安全帽佩戴情况进行了算法的设计。整个系统的核心部分在于图像识别以及特征提取算法的设计。首先通过对人脸的定位来间接获取待检测区域，再通过对该区域进行相应的特征提取，来判断该区域是否存在安全帽，以此达到检测效果。本系统可以检测施工区域工人安全帽佩戴情况并及时反馈，由此监督工人佩戴安全帽，从而大幅减少由于工人缺少防护措施而发生事故的情况，切实保障工人生命安全以及提升工地安全等级。','6'),(42,'2019KSP06007','2019KSZ06021',4,1,200631010082,'2020-06-01 00:00:00',500,'计算机科学学院',4,'项目详细方案\n项目简介 PPT\n',NULL,NULL,NULL,5,5040,'1.曙光大数据平台，\n2.机器学习平台python(Pandas、Numpy 和 Matplotlib, scikit-learn)\n3.开源深度学习平台(tensorflow等)\n4.企业数据集','基于深度学习的企业画像及分类','2019-12-10 16:24:25','2019-12-05 00:00:00','明理楼C1104',4,'2019-12-25 10:38:45',3,'实现僵尸企业的识别分类。\n僵尸企业是指缺乏盈利能力却能够以低于市场最优利率成本获得信贷资源，依靠外界输血而缺乏自生能力的企业。僵尸企业的存在破坏了市场机制，加剧了信贷资源的错配，带来了严重的产能过剩问题，还对其他非僵尸企业产生了投资挤出效应。僵尸企业如果不能够及时处置，经济动能转换以及高质量发展就无法保障，去杠杆工作的受阻将加大系统性金融风险。\n僵尸企业的识别标准主要有官方标准、 CHK 标准， FN-CHK 标准以及各类 FN-CHK 修正标准等。通过各类标准分类识别僵尸企业均有其局限性，尤其是标准的制定有其主观 性，因此基于企业画像分类识别方法成为首选。\n本项目将基于不同行业的 5 万家企业相关信息，其中定义为僵尸企业的有 2 千家。通过划分训练集和测试集，并采用统计、分析、挖掘等技术，完善企业画像的各维度标签','6'),(43,'2019KSP06008','2019KSZ06022',4,1,200631010082,'2020-06-01 00:00:00',500,'计算机科学学院',4,'项目详细方案\n游戏详细设计，demo程序\n',NULL,NULL,NULL,5,5040,'开源游戏开发的工具','基于地铁出行场景的小游戏设计','2019-12-10 16:33:30','2019-12-05 00:00:00','明理楼C1104',4,'2019-12-25 10:38:45',3,'基于地铁出行场景设计实现 APP 内嵌入小游戏。通过各种运营手段来提升用户活跃与粘性。考虑场景特点：绿色出行，低碳环保；上下班高峰人流量大、时间固定；站 点与周边 POI（ Point of interest）的固定联系等。 考虑用户特征：通勤族、游客等，以 20-40 岁年龄段为主。 考虑公共交通的行业特点，游戏主题应健康、积极。可结合大数据：用户年龄段、性别、规律乘车站点、路线、时段等用户画像 标签。可结合 AR 等新互动技术。\n项目需要阐述游戏设计，包括整体概念故事、流程、数值模型； 给出系统技术设计，包括系统架构，与外部接口关系等。初步构想：打开APP扫码乘地铁时会有地铁站专属精灵出现，客户有一定概率可以捕获，用户注册时会免费赠送一只精灵，对于捕获的精灵可以培养，并与好友进行互动，通过随机数生成算法来计算客户捕获精灵的概率，收集到一条地铁线上的所有精灵以后可以获得一定的地铁乘坐优惠。在特定的地铁站可以进入好友界面获取好友的精灵经验，以及部分精灵培养物资。在加入一些反盗取的陷阱来增强趣味性。设置好友排行榜以此。\n','6'),(44,'2019KSP06009','2019KSZ06023',4,1,200831010049,'2020-06-01 00:00:00',3000,'计科院综合实验室',4,'结题报告、软件APP',NULL,NULL,NULL,5,500,'pc机、realwear智能AR眼镜、移动手机','石化企业现场直播培训教学及远程指导','2019-12-10 16:54:20','2019-12-05 00:00:00','明理楼B区',4,'2019-12-25 10:38:45',2,'传统方式上的教学培训采取集中开会讲座、发放相关手册自主学习、培训考试等，这种方式组织难度大，学生不可控，参与学习的人员有限，加上大部分是以文字的方式呈现，无法引起新入职员工的充分理解，造成培训效率低下。如果采取实地参观的培训方式则会因为新入职员工对安全知识掌握不够，进入危险区或是触碰紧急开关及有毒物质等，带来巨大的安全隐患。\n通过我们的app负责培训的教师可以实现在石化企业现场，利用AiStone软件系统，为位于各个地方的学员进行教学培训直播，教学内容直观清晰，打破了场地限制，避免现场观看的安全隐患。另外，培训直播可以录制保存，后续可反复使用，提高培训效率。','6'),(45,'','2019KSZ06024',-4,2,200831010049,'2020-11-01 00:00:00',3000,'计科院综合实验室',4,'结题报告、软件app',NULL,NULL,NULL,5,500,'pc机、realwear智能AR眼镜','AR智能设备巡检及维修','2019-12-10 16:57:09','2019-12-05 00:00:00','明理楼B区',4,'2019-12-11 08:46:15',2,'在生产安全监督和巡检方面分为对设备和对人的监督检查，对设备的监督检查中，传统方式的巡检采取人眼观察、纸笔和对讲机记录、防爆手机拍照等方式进行。通常会造成巡检工具过多、数据保存混乱、文件缺失和二次电子化，不能解放双手，增加工人负担，效率低下。在巡检过程中员工往往由于安全意识淡薄，比如不佩戴安全帽、高空作业不佩戴安全绳、非法进入危险区域、厂区内使用非防爆手机等，产生的安全隐患也无法进行合理监控。\n由于没有智能的监管方式，往往给管理造成困扰。而我们的app，结合RealWear硬件设备，通过语音命令进行生产安全监督，在确定巡检人员信息后根据事先设定的巡检计划进行日常巡检。巡检数据实时回传服务器永久保存。巡检过程中发现异常后，可对异常情况进行语音拍照及录像，而巡检过程中发现的问题需要远程他人协助时，可以启动通讯功能，实现远程音视频互通，高效精准解决问题。\n','6'),(46,'2019KSP06010','2019KSZ06025',4,1,200831010049,'2020-06-01 00:00:00',500,'计科院综合实验室',4,'结题报告、软件app',NULL,NULL,NULL,5,500,'pc机、realwear智能AR眼镜','基于陀螺仪实现跌落识别系统','2019-12-10 16:59:09','2019-12-05 00:00:00','明理楼B区',4,'2019-12-25 10:38:45',2,'利用硬件上的陀螺仪加上AI视频分析技术，能够实现人员跌倒自动识别与警报功能。利用上述智能系统，消除由于员工安全意识淡薄埋下的安全隐患，为日常的生产安全保驾护航。','6'),(47,'2019KSP06011','2019KSZ06026',4,1,200831010049,'2020-06-01 00:00:00',3000,'计科院综合实验室',4,'结题报告、软件app',NULL,NULL,NULL,5,500,'PC机、realwear智能AR眼镜','基于图像识别的安全设备穿戴检测','2019-12-10 17:03:35','2019-12-05 00:00:00','明理楼B区',4,'2019-12-25 10:38:45',2,'基于图像识别能够实现危险区域闯入自动识别与记录、安全帽/安全绳佩戴自动识别与记录、对为穿戴合格安全设备的人员做出提示和警报，避免因安全防护设备不到位而造成的危害。','6'),(48,'2019KSP06012','2019KSZ06027',4,1,200831010049,'2020-06-01 00:00:00',500,'计科院综合实验室',4,'结题报告、软件app',NULL,NULL,NULL,5,500,'pc机、realwear智能AR眼镜','基于高斯烟羽模型的有毒气体的分析与检测','2019-12-10 17:06:13','2019-12-05 00:00:00','明理楼B区',4,'2019-12-25 10:38:52',2,'以毒气泄漏为例，我们软件可以第一时间对有毒气体浓度情况进行实时显示，利用高斯烟羽模型算法，结合气象数据，GIS数据，对有毒气体扩散进行科学预测，为应急指挥中的人员疏散提供有力支撑。利用AiStone存储的医疗，消防，设备，厂区设施，人员信息等大数据，结合厂区路线设施情况，合理规划逃生路线，提供科学的技术指导，极大地提高应急效率，降低人员财产损失。','6'),(49,'2019KSP06013','2019KSZ06028',4,1,200831010049,'2020-06-01 00:00:00',3000,'计科院综合实验室',4,'结题报告、软件app、',NULL,NULL,NULL,5,500,'pc机、realwear智能AR眼镜','石化工厂生产安全数据分析','2019-12-10 17:15:31','2019-12-05 00:00:00','明理楼B区',4,'2019-12-25 10:38:52',2,'在数据统计及挖掘方面，传统方式上巡检数据只作为数据进行存档，而没有真正地利用起来。即使有些系统进行了数据的某些维度的数据统计，也没有利用先进数据挖掘或者人工智能技术，从中得到有价值的信息。\n而利用我们系统，将对石化企业的设备，以及巡检信息进行深度的数据挖掘。例如分析硬件采集的各种数据，建立各种先进科研算法，比如生命体征检测模型、设备寿命推测模型等，对巡检设备进行综合计算，进行安全预警和设备维修预判。\n','6'),(50,'2019KSP06014','2019KSZ06029',4,1,200631010039,'2020-06-01 00:00:00',500,'计算机科学学院机房',1,'用TensorFlow实现AI换脸方法或系统',NULL,NULL,NULL,5,1050,' 深度学习Python、深度学习TensorFlow、数据的可视化、数据增强、自编码器、上采样与下采样子像素卷积','基于TensorFlow实现AI换脸方法研究','2019-12-10 19:50:13','2019-12-05 00:00:00','明理楼B413',4,'2019-12-25 10:38:52',2,'人脸互换是计算机视觉领域比较热门的一个应用，它可以应用于视频合成，提供隐私服务，肖像更换等各类应用。本实验将从自编码器，上采样，数据增强等知识点出发，对深度学习下的人脸互换进行研究。并且利用 TensorFlow 2.0 实现川普和道格拉斯?凯奇的人脸互换','6'),(51,'2019KSP06015','2019KSZ06030',4,1,199831010013,'2020-06-01 00:00:00',500,'计算机科学学院综合实验室',3,'软件（微信小程序）1项，总结报告1份',NULL,NULL,NULL,4,200,'PC机，Windows操作系统','西柚失物招领微信小程序','2019-12-10 20:45:44','2019-12-05 00:00:00','明理楼B区4楼',4,'2019-12-25 10:38:52',1,'学生通过微信登录，发布失物招领信息或者寻物启事等','6'),(52,'','2019KSZ06031',-4,2,200631010082,'2020-11-01 00:00:00',3000,'计算机科学学院',4,'项目简介PPT\n项目演示视频\n系统完成图像输入、目标检测、检测输出三大功能',NULL,NULL,NULL,5,7920,'目标检测最新开放数据集Safety-Helmet-Wearing-\nDataset\nGoogle开源深度学习框架Tensorflow2.0\nCUDA驱动提供GPU算力支持','基于深度学习计算机视觉的安全帽检测','2019-12-10 21:35:21','2019-12-05 00:00:00','明理楼C1004',4,'2019-12-11 08:46:15',3,'2017 年全国安全生产数据分析后，发现生产安全事故中 95%的原因是作业人员的不安全行为导致的。工业化环节的人工智能应用，绝大多数都与机器视觉技术有关，业界急切的希望能通过神经网络软件解决如未正确确穿戴劳保用品等问题。本实验使用开放数据集对网络进行训练，使之能识别图片中的人员是否佩戴安全帽，并以检测框的形式实时展示。','6'),(53,'2019KSP06016','2019KSZ06032',4,1,200631010039,'2020-06-01 00:00:00',500,'计算机科学学院机房',4,'小程序开发完成或学科竞赛省级三等奖及以上一项或软件著作权一项',NULL,NULL,NULL,4,1050,'具有HTML、CSS、JavaScript等前端技术基础、市场调研能力、java编码能力以及数据库操作能力','基于云计算的智慧党建','2019-12-11 09:03:59','2019-12-05 00:00:00','明理楼B406',4,'2019-12-25 10:38:52',2,'基于云计算的智慧党建，充分运用云计算改进党员教育管理，来方便党建工作的发展和弘扬中国共产党伟大精神，并帮助党委等党机构人员处理党的基本事物的一个高效率的平台。以云计算为基础，提供最可靠、最安全的数据存储服务；降低对客户端的设备要求，轻松实现不同设备间数据与应用的共享。\n该平台主要分为党员信息平台、党员学习平台、党员服务平台和党务管理平台。党员信息平台可以对党员的信息进行修改，做到实时更新。党员学习平台中发布的有相关学习资料，可在线学习进行课程的观看和学习，此外，还拥有考试等功能，可以通过考试来检验实际学习效果，并对党员学习情况进行实时记录。党员服务平台用于完成党员日常事务及与组织进行反馈互动等操作。党务管理平台管理党组织信息、党员信息，方便党委决策，发展党员中覆盖党员发展的全流程，在线记录各种阶段信息。智慧党建平台通过线上线下相结合，使得党建工作信息化投资更加节约、性能更加优越、信息更加集成、业务更加协同，从而创新党建工作手段，加强基层组织建设，推动党建工作向科学化转变。\n','6'),(54,'2019KSP06017','2019KSZ06033',4,1,200931010035,'2020-06-01 00:00:00',500,'计算机科学学院综合实验室',3,'学科竞赛省级三等奖以上三项、软件著作权一项','[\"6\"]','[\"25\"]','[2017,2018]',3,500,'深度学习Python、深度学习TensorFlow、数据的可视化、数据增强、自编码器、上采样与下采样子像素卷积','基于协同过滤的个性化电影推荐系统研究','2019-12-11 09:12:02','2019-12-05 00:00:00','明理楼B412',4,'2019-12-25 10:38:52',1,'本项目分为离线计算服务和实时计算服务。离线计算服务根据电影信息数据，历史数据中所有用户对电影的评分数据，用户对电影打的标签数据，通过spark sql进行数据批处理，清洗，转换并保存进mongodb，通过spark milib采用 ALS 作为协同过滤算法，分别根据 MongoDB 中的用户评分表和电影数据集计算出用户电影推荐矩阵以及电影相似度矩阵。实时计算服务通过spark streaming实时读取kafka中存入的用户行为数据，并通过离线服务中计算出的电影相似度矩阵实时对用户进行电影推荐。本项目旨在打造用户的个性化电影推荐平台，满足用户的需求。','6'),(55,'2019KSP06018','2019KSZ06034',4,1,200931010035,'2020-06-01 00:00:00',500,'计算机科学学院综合实验室',3,'成品展示','[\"6\"]','[\"25\"]','[2017,2018]',3,1000,'深度学习Python、深度学习TensorFlow、数据的可视化、数据增强、自编码器、上采样与下采样子像素卷积','图像风格迁移','2019-12-11 09:14:35','2019-12-05 00:00:00','明理楼B412',4,'2019-12-25 10:38:52',1,'图像风格迁移，是指利用算法学习著名画作的风格，然后再把这种风格应用到另外一张图片上的技术。著名的国像处理应用Prisma是利用风格迁移技术，将普通用户的照片自动变换为具有艺术家的风格的图片。使用TensorFlow 实现一个快速风格迁移的应用','6'),(56,'','2019KSZ06035',-4,2,200831010053,'2020-11-01 00:00:00',3000,'智能与网络化系统研究中心',1,'深度渲染云平台软件1套；公开发表论文1篇；获得软件著作权2项；申请发明专利1项；',NULL,NULL,NULL,6,1600,'计算机若干，GPU','三维场景深度渲染云平台的设计与实现','2019-12-11 09:40:14','2019-12-05 00:00:00','明理楼C1103',4,'2019-12-11 14:28:12',1,'深度渲染云平台，使用深度学习技术提取三维场景中的光照传播与图形属性的交互行为特征，借助GPU高速并行计算能力，快速产生包括阴影、反射、折射、环境光照等高级光照效果的照片级高真实感图像。系统采用B/S架构，前端进行渲染任务设计与可视化，后端完成图形绘制。系统具有跨平台、扩展性强、易部署等特点，可广泛应用于虚拟现实、影视制作、互动娱乐、工业设计等领域。','6'),(57,'','2019KSZ06036',-4,2,201799010013,'2020-11-01 00:00:00',3000,'图像处理与并行计算实验室',1,'发表论文',NULL,NULL,NULL,4,1500,'实验室具有GPU、多核CPU服务器设备，课题组完成地震信号题目处理、并行计算相关项目多项。','异构平台的抛物线Radon变换并行算法研究','2019-12-11 16:04:13','2019-12-05 00:00:00','明理楼B515',1,'2019-12-13 20:53:00',1,'抛物线Radon变换在地震勘探资料处理中通常被用于多次波的压制和去除，目的是去除道集中的曲线型噪声。目前，混合域抛物线Radon变换可以保证的很好的分辨率和计算速率，但对于数据规模巨大的地震道集，仍需要很长的地震解释周期。因此，本项目基于CPU-GPU异构系统对混合域抛物线Radon变换算法进行并行化，在保证道集质量的前提下，提升道集优化效率。','6'),(58,'2019KSP06019','2019KSZ06037',4,1,200831010052,'2020-06-01 00:00:00',500,'计算机学院综合实验室',4,'软件（移动端应用程序）1项、总结报告1份',NULL,NULL,NULL,5,300,'PC机、Windows操作系统','基于人脸模糊的实时监控系统的设计与研究','2019-12-11 17:03:36','2019-12-05 00:00:00','明理楼4楼',4,'2019-12-25 10:38:52',1,'移动端软件功能：对图片中的人脸进行检测和模糊','6'),(59,'2019KSP06020','2019KSZ06038',4,1,200831010052,'2020-06-01 00:00:00',500,'计算机学院综合实验室',4,'移动端软件一项、总结报告一份',NULL,NULL,NULL,5,300,'PC机\nWindows操作系统','基于人脸搜索的图片管理移动客户端设计与实现','2019-12-11 17:05:37','2019-12-05 00:00:00','明理楼4楼',4,'2019-12-25 10:38:52',1,'移动端软件功能：拍照上传、支持人脸搜索照片。','6'),(63,'2019KSP06021','2019KSZ06040',4,1,200631010082,'2020-06-01 00:00:00',500,'计算机科学学院',4,'项目详细方案\n项目简介 PPT\n','[\"6\"]',NULL,NULL,5,50,'（1）	曙光大数据平台，\n（2）	机器学习平台python(Pandas、Numpy 和 Matplotlib, scikit-learn)\n（3）	开源深度学习平台(tensorflow等)\n（4）	房价数据集','基于机器学习的房价预测模型','2019-12-11 17:21:47','2019-12-05 00:00:00','明理楼C1104',4,'2019-12-25 10:38:52',3,'项目主要功能是基于房价预测通过套用多种算法模型进行对比评估，得出最优算法。\n本次选题是基于kaggle上面的经典的房价预测试题。影响房价的因素有很多，在本题的数据集中有 79 个变量几乎描述了爱荷华州艾姆斯 (Ames, Iowa) 住宅的方方面面，要求预测最终的房价。 \n训练数据一共有1460条，预测数据一共有1459条，每一条数据都有81(包含ID)个特征，其中部分数据存在缺失值(NA)和异常值，缺失值和异常值的产生可能是在录入数据的时候或者某些其他原因产生的，我们需要对其进行一些处理，因为它们可能会对于模型的预测造成一些影响。\n本项目将基于对房价影响的因素进行分析。通过划分训练集和测试集，并采用统计、分析、挖掘等技术，来进行数据清洗、特征工程、套用模型以及参数调整等方式，实现对房价的预测；最后在套用模型时采用多种不同类型的算法建立模型，从而达到对比评估出实现房价预测最优算法的目的。\n','6'),(64,'2019KSP06022','2019KSZ06041',4,1,200631010082,'2020-06-01 00:00:00',500,'计算机科学学院',4,'项目详细方案\n项目简介 PPT\n',NULL,NULL,NULL,5,5040,'（1）	曙光大数据平台，\n（2）	机器学习平台python(Pandas、Numpy 和 Matplotlib, scikit-learn)\n（3）	开源深度学习平台(tensorflow等)\n（4）	宫颈癌数据集','基于大数据分析的宫颈癌患病率的预测','2019-12-11 20:23:02','2019-12-05 00:00:00','明理楼C1104',4,'2019-12-25 10:38:52',3,'项目主要功能是基于大数据平台的数据分析来预测宫颈癌患病率，根据患病几率的大小建议用户是否去医院就诊。\n本次选题基于UCI机器学习仓库的宫颈癌数据，是由委内瑞加拉加斯医院大学收集的患者信息，该数据集罗列了可能影响宫颈癌的36个因素，囊括内容较广。\n训练数据一共有858条，每一条数据都包含36个特征，其中有部分数据由于隐私问题或缺少价值出现缺失(NA)，但是我们将对这些出现缺失值的属性先进行处理后再建立模型来预测患病率。\n项目主要利用支持向量机、逻辑回归、决策树、KNN、梯度提升、随机森林、深度学习等算法建立模型，并采用数据清洗、分析、挖掘等技术，来构造特征，调整参数，从而分析出宫颈癌的各种诱发因素的所占比例以及用户患病的概率。最后利用数据分析结果向用户展现一个预测宫颈癌的Web前端网页，当用户有所需求时，在网页输入相关属性，后台利用这些属性进行计算，从而告知用户罹患宫颈癌的概率。如果概率超过一定比例我们将建议用户及时去医院进行进一步检查\n','6'),(66,'','2019KSZ06042',-4,2,200331010044,'2020-11-01 00:00:00',5000,'图像处理与并行计算实验室',1,'科研论文一篇，软件著作权一个。','[\"6\"]','[\"25\"]','[2017]',6,1050,'cpu i7及以上；gpu 1060以上 ；anaconda集成环境 python3.6','基于深度学习的煤层气“甜点”识别','2019-12-11 21:08:33','2019-12-05 00:00:00','明理楼B515',4,'2019-12-12 08:56:16',1,'为了解决在煤层气过程中由于“甜点”区域位置不详导致经济效益低下的问题，从而提出基于深度学习的煤层气“甜点”识别。首先使用神经网络的方法解决样本的甜度标注不详的问题，其次使用模糊聚类的方法对甜点区域进行划分与预测，最后使用决策树识别甜点影响因素，建立甜度标准评价体系。最终实现对煤层气的“甜点”识别。','6'),(68,'','2019KSZ06043',-2,2,201799010013,'2020-11-01 00:00:00',3000,'图像处理与并行计算实验室',1,'发表论文',NULL,NULL,NULL,3,1500,'实验室具有GPU、多核CPU服务器设备，课题组完成地震信号题目处理、并行计算相关项目多项。','地震稀疏反演算法的并行化研究','2019-12-11 22:06:02','2019-12-05 00:00:00','明理楼B515',1,'2019-12-13 20:19:08',1,'近年来，稀疏反演相关理论作为一种信号重构的新方法，逐渐应用到地震反演领域。相比与常规地震反演方法，稀疏反演能提高重构地震信号的信噪比。然而对于大规模的地震数据，稀疏反演算法在CPU平台的运行时间较长，影响了地震数据处理的效率。针对求解稀疏反射系数和道集数据处理过程，本项目将其中耗时较多的运算移植到GPU上实现并且对数据的访存进行了优化。同时，项目对比了CPU和不同的CPU-GPU异构方式下的算法时间效率。','6'),(69,'2019KSP06023','2019KSZ06044',4,1,201799010013,'2020-11-01 00:00:00',2500,'图像处理与并行计算实验室',1,'发表论文',NULL,NULL,NULL,4,1500,'实验室具有GPU、多核CPU服务器设备，课题组完成地震信号题目处理、并行计算相关项目多项。','叠前时间偏移的并行Q补偿算法研究','2019-12-11 22:06:58','2019-12-05 00:00:00','明理楼B515',1,'2019-12-13 20:53:09',1,'在地震资料处理中，Q补偿算法能有效地对地震波进行振幅补偿和相位校正，为地震反演和储层预测提供更准确的信息。对于大规模的地震道集数据处理，Q补偿算法在CPU计算平台下执行时间较长，影响了地震解释处理的效率。对Q补偿算法进行分析得知大量时间消耗在批量短时傅里叶变换中。本项目在GPU平台上对快速的批量短时傅里叶变换算法并行化并将其应用于Q补偿算法中。','6'),(70,'','2019KSZ06045',1,2,201799010013,'2020-11-01 00:00:00',3000,'图像处理与并行计算实验室',1,'发表论文',NULL,NULL,NULL,4,1500,'实验室具有GPU、多核CPU服务器设备，课题组完成地震信号题目处理、并行计算相关项目多项。','改进Smoothlet变换算法并行化研究','2019-12-11 22:07:52','2019-12-05 00:00:00','明理楼B515',4,'2019-12-13 20:36:39',1,'Smoothlet变换是基于Wedgelet变换所提出的一种针对曲线型的基准线逼近的超小波变换，在空域上利用图像块的位置、尺度、方向和边缘过度信息对图像进行分解，理论性能优于傅里叶变换和小波变换。Smoothlet变换能较好的对宏块中的基准线进行逼近。基于Smoothlet变换，结合图像编码理论，提出改进Smoothlet变换，改良过渡区域表示方式。提出新的预测编码方法——块内预测方法，研究基于方形模板的块内预测编码。由于模板数量巨大，需建立多尺度矩形模板优选模型，利用模板形状在位置、尺度和方向上的相似性，减少参与计算的模板数量，减少计算量。因此，充分利用GPU强大的计算能力和有效利用GPU的特殊内存读取与存储方式来优化加速，提升视频编码效率。','6'),(72,'','2019KSZ06046',1,1,200731010048,'2020-06-01 00:00:00',500,'计科院综合实验室',1,'论文及程序',NULL,'[\"24\"]','[2017,2018]',3,200,'gpu服务器','基于贝叶斯方法的超声运动估计方法研究与实现','2019-12-11 23:26:15','2019-12-05 00:00:00','明理楼B515',4,'2019-12-12 08:56:16',1,'基于贝叶斯方法的运动追踪方法研究','6'),(76,'','2019KSZ06048',1,2,201799010013,'2020-11-01 00:00:00',2500,'图像处理与并行计算实验室',1,'发表论文或参加竞赛',NULL,NULL,NULL,4,1500,'实验室具有GPU、多核CPU服务器设备，课题组完成地震信号题目处理、并行计算相关项目多项。','基于深度学习的UPS指示灯智能检测系统研究','2019-12-12 11:12:11','2019-12-05 00:00:00','明理楼B515',4,'2019-12-13 20:38:18',1,'近年来,深度学习技术有着跨越式的发展，深度学习越来越多的应用在生产实际当中。我们设计了一种基于深度学习的UPS指示灯智能检测系统，克服了传统目标检测当中低精度，受背景干扰较大的缺点。该系统的主要功能是通过摄像头对UPS指示灯的亮灭进行实时的监控，从而来判断该指示灯的系统是否正常工作。具体实现包括：在tensorflow/Pytorch等深度学习的框架下，利用目标检测算法对UPS指示灯检测模型的训练，包括获取、增强和标注数据集,训练模型及测试模型。根据实际需求,对UPS指示灯系统进行详细设计。','6'),(77,'2019KSP06024','2019KSZ06049',4,1,200731010044,'2020-06-01 00:00:00',500,'计算机综合实验教学中心',4,'源代码、程序演示',NULL,NULL,NULL,3,400,'数台Windows计算机，利用MATLAB软件处理脑电图 ； Python语言及Pycharm编辑器实现异常脑电信号的检测与识别、；Anaconda3开源库（资源管理器）；Mysql数据库存储测试数据，参与实验学生综合素质优秀，具有基本的项目开发经验','基于融合小波变换多分辩率分析的脑电信号分析系统','2019-12-12 15:43:19','2019-12-05 00:00:00','明理楼4楼',4,'2019-12-25 10:38:52',1,'        癫痫是大脑神经元突发性异常放电，导致短暂的大脑功能障碍的一种慢性疾病。癫痫的发作往往会给病人带来极大的痛苦，因此医生需要及时诊断患者病况，并给出正确有效的治疗方案。然而医生诊断癫痫病最直接的方式为人工判断脑电图，过程十分耗时，既给医生带来极大的负担，也使得病人得不到最及时的治疗。因此，开发一套癫痫脑电自动检测识别的系统对于高效精准地诊断癫痫具有极大的临床意义。\n        研究癫痫信号对于诊断癫痫、定位癫痫致病灶、分辨癫痫的发作类型以及降低癫痫患者的发作频率和癫痫致残、致死的发生率有着重要的意义。癫痫疾病疾病影像智能分析系统的核心便在于快速准确地确定患者脑电信号模型，分析异常脑电信号，结合医师的就诊经验得出就诊结果。\n       该系统采用了基于小波变换的癫痫信号检测算法。算法分为癫痫信号预处理、特征提取与癫痫信号检测分类三部分。首先利用小波阈值函数去除癫痫信号中的伪差信号；其次针对癫痫脑电信号的非平稳特性选用非线性动力学算法进行癫痫信号特征提取；最后，通过支持向量机对癫痫信号进行分类，从众多脑电信号中筛选出真正的癫痫信号，并给出具体类别信息，反馈给系统的智能核心，出具最终的诊断报告。\n       此外，由于脑电信号有诸多不同的浅层特征，如时域特征、频域特征、线性特征、非线性特征等，该系统利用深度学习和多视角学习技术，对多个不同的浅层特征进行深度特征提取得到深度特征，并和浅层特征一起构建出脑电信号的多视角特征集。进一步，使用多视角学习技术对多视角特征集进行分类，从而实现癫痫检测的功能。\n       最后，利于基于模板的文本生成算法，根据智能分析和诊断算法给出的病人在睡眠期脑电波结果，生成基本统计信息，包括异常脑电波的种类，及其出现的时段、次数等，根据诊断专家指定的模板生成报告。该分析报告将作为专家诊断中的科学参考，以帮助医生更加高效快速地得出就诊结果。\n      癫痫疾病影像智能分析系统致力于快速准确地分析患者的脑电波报告，标注出其中的异常脑电信号，出具诊断报告，为医师诊断提出参考。减轻了医师长时间分析患者报告的负担，在提高医师诊断效率的同时，也降低病人的诊断成本。在智慧医疗理念贯穿社会的今天，癫痫波的智能检测能够为医生和病人提供协同化的智能服务，极大提高群众的就医体验，具有无效的发展前景。\n\n','6'),(78,'2019KSP06025','2019KSZ06050',4,1,200531010046,'2020-06-01 00:00:00',500,'计算机综合实验教学中心',4,'系统展示、设计报告','[\"6\"]','[\"24\",\"25\",\"27\",\"28\"]',NULL,3,500,'实验中运用数据库服务器、IDEA项目开发环境、高性能台式计算机、应用服务器、数据库服务器、以及投影仪、等设备、于计算机综合实验教学中心进行实验。项目成员都具有软件开发相关知识以及此实验项目中各自对应部分要求所需的技能。','基于SpringBoot的IT在线学习平台','2019-12-12 15:52:03','2019-12-05 00:00:00','明理楼c1005',4,'2019-12-24 18:56:53',1,'（1）该项目是一个提供IT职业课程在线学习的平台，它为即将和已经加入IT领域的技术人才提供在线学习服务，用户通过在线学习、在线练习、在线考试等学习内容，最终掌握所学的IT技能，并能在工作中熟练应用；用户还能在其中了解IT行业每个方向的学习路线，学习资料和书籍的推荐。\n（2）该项目采用B2B2C业务模式，即向企业或个人提供在线教育平台提供教学服务，老师和学生通过平台完成整个教学和学习的过程。','6'),(79,'','2019KSZ06051',-4,2,200531010046,'2020-11-01 00:00:00',3000,'计算机综合实验教学中心',4,'授权专利或公开刊物发表论文或省级以上竞赛获奖。','[\"6\"]','[\"24\",\"25\",\"27\",\"28\"]',NULL,3,500,'实验中运用数据库服务器、IDEA项目开发环境、高性能台式计算机、应用服务器、数据库服务器、以及投影仪、等设备、于计算机综合实验教学中心进行实验。项目成员都具有软件开发相关知识以及此实验项目中各自对应部分要求所需的技能。','基于微信小程序的运动与学习信誉邀约平台','2019-12-12 15:55:46','2019-12-05 00:00:00','明理楼c1005',4,'2019-12-13 09:04:00',1,'该运动与学习信誉邀约平台致力于将在“运动”与“学习”方面有某种需求的学生聚在一起，满足学生的需求。\n（1）“运动”方面的预约\n		在运动方面有需求的同学，可以发起组队，发起组队的同学为此次活动的负责人。负责人需指定运动的项目，时间与地点等信息。负责人也要负责场地 安排。通过线上邀约，线下运动的方式来完成需求。比如一同学想要想要打乒乓球，却找不到人一起运动。便可以发布在此平台上，指定运动的项目，然后定好具体的时间与地点、人数。 地点是否可行，需要负责人来确认。 \n（2）“学习”方面的预约\n		在学习方面有需求的同学，可以发起组队，发起组队的同学为此次活动的负责人。负责人需指定学习的类型，时间与地点等信息。负责人也要负责场地 安排。通过线上邀约，线下一起学习的方式来完成需求。比如一位同学正在忙于考研的学习，但是感到一个人学习没有动力。便可发布到平台，寻找同样在忙于考研的同学，一起组队学习，一起努力。\n（3）实名制与信用制度\n		学生在注册时，需要绑定自己的一卡通信息。确保校内用户的实名制落实。同时每位用户也有自己的信誉值。发布的项目为执行或者为参与，会降低自己的信誉值。顺利完成项目，可以提高信誉值。发布项目时，会显示发布者的信誉值，便于其他学生的参考与判断。\n','6'),(80,'','2019KSZ06052',-2,2,200531010046,'2020-11-01 00:00:00',3000,'计算机综合实验教学中心',4,'授权专利或公开刊物发表论文或省级以上竞赛获奖。','[\"6\"]','[\"25\",\"27\",\"24\",\"28\"]',NULL,3,500,'实验中运用压力、红外线传感器、GPS定位模块、蓝牙模块、Android实验平台、 模块于计算机综合实验教学中心进行实验。项目成员都具有嵌入式相关知识以及此实验项目中各自对应部分要求所需的技能。','“关艾”——智能提醒药盒','2019-12-12 16:00:40','2019-12-05 00:00:00','明理楼c1005',4,'2019-12-17 11:56:45',1,'（1）提醒携带药盒功能\n	药盒通过手机蓝牙连接，当药盒和手机断开蓝牙连接时，使手机振动提醒用户检查药盒是否携带，并提供用户“已携带”和“未携带并稍后提醒”以及“未携带并不再提醒”选项，若用户不作选择，手机便会一直振动提醒。\n	（2）隐秘提醒按时服药功能\n	药盒盛放一周剂量的药，用户在微信小程序中设置药的种类、一日服用药的剂量以及每次服药的时间及最晚时间并设置提醒时间间隔。每到服药时间，手机和药盒便会振动提醒服药，每隔一段时间间隔提醒一次。若用户在最晚时间未服药，手机便会一直振动，若半小时后仍未服药，手机提示由振动变为鸣叫。\n（3）提醒按时装药功能\n当检测到药盒内仅剩一次的药物时，便会在手机中振动提醒用户放药入药盒。当药盒内无药时，便会一直振动提醒用户放药直到检测到药盒内药物齐全。','6'),(88,'','2019KSZ06053',-4,2,200131010014,'2020-11-01 00:00:00',2500,'计算机综合实验室',1,'公开发表论文一篇',NULL,'[\"25\",\"24\",\"27\",\"28\"]','[2017,2018,2019]',6,1000,'计算机5台，开发软件若干','基于大数据平台的页岩气压裂设计优化研究','2019-12-13 07:09:03','2019-12-05 00:00:00','明理楼B505',4,'2019-12-13 09:04:00',1,'利用大数据平台对页岩气压裂设计优化进行研究','6'),(89,'2019KSP06026','2019KSZ06054',4,1,200131010014,'2020-06-01 00:00:00',500,'明理楼B505',2,'结题报告 ',NULL,'[\"24\",\"25\",\"26\",\"27\",\"29\"]','[2017,2018,2019]',6,1000,'计算机5台，开发软件若干','基于Flink的分布式计算系统的研究与实现','2019-12-13 07:30:49','2019-12-05 00:00:00','明理楼B505',4,'2019-12-23 16:52:58',1,'基于Flink的分布式计算系统的研究与实现','6'),(90,'2019KSP06027','2019KSZ06055',4,1,200131010014,'2020-06-01 00:00:00',500,'明理楼B505',2,'结题报告 ','[\"6\"]','[\"24\",\"25\",\"26\",\"27\",\"28\",\"29\"]','[2017,2018,2019]',6,1000,'\n计算机5台，开发软件若干','基于微服务的生产资料管理平台研究与实现','2019-12-13 07:32:16','2019-12-05 00:00:00','明理楼B505',4,'2019-12-23 16:52:58',1,'基于微服务的生产资料管理平台研究与实现','6'),(91,'','2019KSZ06056',-4,2,200131010016,'2020-11-01 00:00:00',500,'明理楼B505',2,'结题报告及公开发表论文一篇',NULL,NULL,NULL,6,800,'计算机5台，开发软件若干','固井水泥环应用追踪管理系统','2019-12-13 07:35:06','2019-12-05 00:00:00','明理楼B505',4,'2019-12-13 09:04:00',1,'固井水泥环应用追踪管理系统','6'),(92,'2019KSP06028','2019KSZ06057',4,1,200131010016,'2020-06-01 00:00:00',500,'明理楼B503',2,'结题报告 ',NULL,NULL,NULL,6,800,'计算机5台，开发软件若干','机器学习在页岩气增产措施制定中应用的研究','2019-12-13 07:36:33','2019-12-05 00:00:00','明理楼B503',4,'2019-12-23 16:52:58',1,'机器学习在页岩气增产措施制定中应用的研究\n','6'),(93,'2019KSP06029','2019KSZ06058',4,1,199131010022,'2020-06-01 00:00:00',500,'明理楼B510',2,'结题报告 ',NULL,NULL,NULL,6,800,'计算机5台，开发软件若干','页岩气井产能预测模型研究系统实现','2019-12-13 07:39:07','2019-12-05 00:00:00','明理楼B510',4,'2019-12-23 16:52:58',1,'页岩气井产能预测模型研究系统实现','6'),(94,'2019KSP06030','2019KSZ06059',4,1,199131010022,'2020-06-01 00:00:00',500,'明理楼B510',2,'结题报告 ',NULL,NULL,NULL,6,700,'计算机5台，开发软件若干','基于深度学习的指定语境识别系统的研究与实现','2019-12-13 07:40:09','2019-12-05 00:00:00','明理楼B510',4,'2019-12-23 16:52:58',1,'基于深度学习的指定语境识别系统的研究与实现','6'),(95,'2019KSP06031','2019KSZ06060',4,1,198631010035,'2020-06-01 00:00:00',500,'明理楼B503',2,'结题报告 ',NULL,NULL,NULL,6,800,'计算机5台，开发软件若干','油气管道全生命管理平台研究与实现','2019-12-13 07:42:51','2019-12-05 00:00:00','明理楼B503',4,'2019-12-23 16:52:58',1,'油气管道全生命管理平台研究与实现','6'),(96,'','2019KSZ06061',-4,2,198631010035,'2020-11-01 00:00:00',500,'明理楼B503',2,'公开发表论文一篇',NULL,NULL,NULL,6,700,'计算机5台，开发软件若干','智能气矿物联网应用研究','2019-12-13 07:44:24','2019-12-05 00:00:00','明理楼B503',4,'2019-12-13 09:03:59',1,'智能气矿物联网应用研究','6'),(97,'','2019KSZ06062',-4,2,200831010048,'2020-11-01 00:00:00',5000,'机器学习研究中心',4,'学科竞赛、项目展示等',NULL,NULL,NULL,6,1500,'装有Windows操作系统的电脑若干','基于神经网络的最优物流配送方案应用研究','2019-12-13 11:22:37','2019-12-05 00:00:00','明理楼B509',4,'2019-12-13 14:59:54',1,'在现代物流中，配送是一个重要的与消费者直接相连的环节，一方面可以体现企业的核心竞争力，另一方面通过线路优化，可以提高企业的运作效率，降低配送成本，实现物流科学化。目前市场上仓储类管理系统已经比较完善，但对于不同需求的路线规划还存在一定的短板，基于当前站好“最后一岗”的要求，引用路线优化算法，开发出具有实用性，先进性，高可靠性的路线规划系统已经迫在眉睫。本实验基于机器学习的思想，设计出能够自动分配最优路线的产品，以减少物流成本、物流时间以及增强企业的竞争力，让物流配送更加快捷。','6'),(98,'','2019KSZ06063',-2,2,200431010069,'2020-11-01 00:00:00',2500,'重点项目测试转普通项目立项勿选',1,'重点项目测试转普通项目立项勿选',NULL,NULL,NULL,3,100,'重点项目测试转普通项目立项勿选','重点项目测试转普通项目立项勿选','2019-12-13 16:10:13','2019-12-05 00:00:00','重点项目测试转普通项目立项勿选',4,'2019-12-17 16:57:36',3,'重点项目测试转普通项目立项勿选','6'),(100,'2019KSP06032','2019KSZ06064',4,1,200831010050,'2020-06-01 00:00:00',500,'计算机综合实验教学中心',4,'开发系统一套',NULL,NULL,NULL,4,600,'服务器，台式机','基于区块链的手签合同系统','2019-12-13 16:19:27','2019-12-05 00:00:00','明理楼B区',4,'2019-12-23 16:52:58',2,'本项目基于区块链作为底层技术，设计了一款手签合同的应用。用户只需进行身份验证并注册改应用，就可以轻松实现线上编写合同，签署合同，交易金额等一系列操作。\n       传统的纸质合同签约有诸多弊端，比如其载体是纸，在时间和成本上消耗较大，特殊情况时可能还需要快递寄送合同，流转过程中存在许多潜在风险，比如信息泄露，合同被篡改等。同时，传统合同为了增加合同的可靠性，避免后期产生合同纠纷，往往会有第三方参与，增加了操作的复杂度。\n       基于区块链技术能很好避免传统合同带来的麻烦。基于区块链的加密算法和不可篡改的特点，信息一经存储，任何一方无法篡改，也不会丢失，保证了合同的安全和可靠性，也满足了存证的需求。由于区块链是分布式的数据储存应用模式，有其天然的去中心化特点，合同签署不需要第三方担保人的参与，只需甲乙双方实现点对点的交互即可，极大的节约了成本，降低了用户操作的复杂程度。\n       该应用的适用群体广，适用场景丰富，企业集体和个人都能很好地使用，一般的合同签约通过该应用基本都可以实现。企业方面包括了从业务员编写合同，到经理审核，再到与客户签署合同等一系列流程。集体和个人可以实现买卖合同，租聘合同，赠与合同，承包合同，委托合同等等。为了方便双方金额交易，该应用还实现了线上转账的机制，每次合同签署和金额交易都如实记录，并发布到区块链上，所有区块链上的用户都是见证人，随时可以从区块链上取证，避免了后期合同产生纠纷，省去了许多隐患。','6'),(102,'','2019KSZ06065',-4,2,200931010035,'2020-11-01 00:00:00',2500,'油田信息化实验室',4,'（1）参加比赛获省级三等奖及以上奖励\n（2）公开发表相关学术论文1-3篇\n','[\"6\"]','[\"24\",\"25\"]',NULL,5,1050,'项目参与人员每人均配有个人电脑及显示器，有专门的实验室作为项目实施场地。项目实行指导教师负责制。教学资料充足，能充分保证实验人员完成相关工作。人员配备合理，相关人员各司其职，能够保证项目的正常进行。','基于GIS可视化的林业有害生物飞机防治指挥系统','2019-12-13 19:03:47','2019-12-05 00:00:00','明理楼B505',4,'2019-12-16 08:59:53',2,'近年来，我国林业有害生物飞机防治发展迅速，飞防作业面积已占防治作业总面积的1/4，成为林业有害生物防治的重要手段。但是，随着飞防面积的快速增长、防治服务公司的大量涌入和防治监管能力的相对不足，飞防问题也日益突出，严重干扰了防治市场秩序，影响了防治市场形象，妨碍了防治事业健康发展，各级林业主管部门、有害生物防治管理机构和有良知的社会防治企业热切期盼强化飞机防治监管。\n在飞机防治中使用智能指挥系统能够较好地解决当前林业有害生物飞机防治监管难、监管不到位等问题，有利于促林业有害生物防治市场健康发展，有利于提高林业有害生物防治规范化、智能化、精准化水平。\n《基于GIS可视化的林业有害生物飞机防治指挥系统》（以下简称：飞防），涵盖飞防作业准备、作业规划、作业实时监测与跟踪、作业过程中的安全预警、作业成果评估的闭环业务流程管理。重点解决飞防领域内长期困扰监管人员的“说不清、来不及、看不到、听不明、控不住”的工作难题。\n系统采用B/S架构，结合“互联网+”理念，利用物联网技术、数据治理技术、GIS可视化等技术，建设一套满足全辖区林业有害生物飞机防治作业的智能指挥系统，形成一套适用于森林飞机防治作业的“标准流程与管理办法”，提高监管与指挥技术水平，切实长期有效地保障飞防工作质量。\n','6'),(103,'2019KSP06033','2019KSZ06066',4,1,200131010016,'2020-06-01 00:00:00',500,'数字与智慧油田实验室',2,'1.软件著作权\n2.参加比赛获省级三等奖\n','[\"6\"]',NULL,NULL,6,400,'项目参与人员每人均配有个人电脑及显示器，有专门的实验室作为项目实施场地。项目实行指导教师负责制。教学资料充足，能充分保证实验人员完成相关工作。人员配备合理，相关人员各司其职，能够保证项目的正常进行。','油气井钻井风险预测与控制系统','2019-12-13 19:18:01','2019-12-05 00:00:00','明理楼B406',4,'2019-12-23 16:52:58',2,'本项目主要是开发一个针对不同工况下油气井钻井过程的风险预测和控制的系统。通过输入油气井的钻具组合、井身结构等基本数据和溢流数据，选择不同的工况，再根据地层流体类型及压迫情况提出最为合适的压井方法，主要建议方法有工程师法、司钻法、压回法、置换法。该系统主要具备有新建井潜在风险预测及可行性分析功能，和对钻后油气井进行查看、分析计算与优化的风险跟踪评价功能。该系统通过严密准确的计算以及高斯消去、定向井井眼轨迹计算等算法对井下风险进行提前预知和识别，对钻井可行性进行分析，模拟预测井下施工情况，进而控制隐患，给出风险提示，并且生成规避风险的施工报告。力求降低钻井过程中的风险性和未知性，能够对高级别的风险防控起到重要作用，以达到节省人力物力、保障财产和人身安全的目的，对于勘探开发进度和油田的总体经济效益有着重要的意义，进而提升我国钻井风险预测的技术水平。','6'),(105,'','2019KSZ06067',-4,2,200331010047,'2020-11-01 00:00:00',2500,'明理楼C1010',1,'完成软件的设计与开发，并在成都市新都区等地方进行项目推广，撰写发表1-2篇论文，申请著作权','[\"6\"]','[\"24\",\"25\",\"27\"]','[2017,2018,2019]',6,400,'电脑，参考书籍与网络资料','基于数据挖掘的车辆不良驾驶行为分析','2019-12-14 10:41:23','2019-12-05 00:00:00','明理楼C区1010',4,'2019-12-14 13:57:02',2,'利用数据挖掘与数学建模技术建立运输车辆安全驾驶行为评价模型。通过对所给GPS轨迹数据等进行可视化，分析并提取不良驾驶行为指标，为安全评价模型的建立做准备。\n\n经过对驾驶行为挖掘算法和评价模型研究之后，通过研究的算法进行系统化的应用，采用ASP.NET技术构建了基于大数据分析的驾驶行为识别与评价平台。以此达到实施监控运输车辆不良驾驶行为的作用，更好的帮助运输车辆管理部门开展道路运输过程安全管理的数据分析，提高运输安全管理水平和运输效率。\n','6'),(106,'','2019KSZ06068',1,2,200131010014,'2020-11-01 00:00:00',5000,'计算机实验室',4,'结题报告\n演示视频\n检测系统',NULL,NULL,NULL,5,7920,'开源数据集\nGPU','基于深度学习安全帽佩戴检测系统','2019-12-14 20:04:25','2019-12-05 00:00:00','明理楼b505',4,'2019-12-16 08:59:53',3,'基于计算机视觉的工地安全检测系统\n','6'),(107,'','2019KSZ06069',-4,2,200631010041,'2020-11-01 00:00:00',3000,'创数据实验室',4,'软件著作权2项、发明专利1项、软件系统1套',NULL,NULL,NULL,5,5000,'曙光大数据中心服务器集群，高性能服务器（56核，256G内存，2张2080TI GPU）','井场安全智能实时预警平台设计','2019-12-14 20:54:02','2019-12-05 00:00:00','西南石油大学明理楼C区1108',4,'2019-12-16 08:59:53',2,'在石油开采过程中，经常会发生安全事故，本项目将建立一个井场安全智能实时预警平台，对油井边的监控视频进行实时分析，一旦发现不规范的操作便会发出预警，从而减少人员伤亡。','6'),(108,'','2019KSZ06070',-4,2,199131010022,'2020-11-01 00:00:00',2500,'计算机实验室',4,'1.省级三等奖及以上\n2.发表论文1-3篇\n3.取得软件著作权',NULL,NULL,NULL,6,7000,'开发数据集\ngpu','基于深度学习的建筑工地人员安全隐患监测系统','2019-12-14 21:19:34','2019-12-05 00:00:00','计算机科学学院创新创业俱乐部',4,'2019-12-16 08:59:53',2,'基于深度学习的建筑工地人员安全隐患监测系统','6'),(109,'','2019KSZ06071',1,2,200631010036,'2020-11-01 00:00:00',5000,'图像处理与并行计算实验室',1,'公开发表论文1篇',NULL,NULL,NULL,3,6480,'具备GPU服务器、并行计算服务器等','超声弹性成像全局应变估计算法的研究及应用','2019-12-16 10:30:27','2019-12-05 00:00:00','明理楼B515',4,'2019-12-16 14:46:36',1,'超声弹性成像技术的基本思想是从超声信号中获取生物组织的硬度信息并进行成像。超声弹性成像技术在疾病检测和诊断等临床实践中具有广阔的应用前景。生物组织的应变估计在超声弹性成像中扮演着举足轻重的角色。目前，大部分应变估计算法都是基于窗口的，例如互相关方法和仿射估计。然而，基于窗口的应变估计算法需要考虑窗口大小、窗口重叠和计算效率三个因素。而在Horn Schunk光流估计框架下，全局应变估计算法能够在不需要多窗口的情况下有效率地计算出全局应变。','6'),(110,'','2019KSZ06072',1,2,199531010023,'2020-11-01 00:00:00',5000,'图像处理与并行计算实验室',1,'公开发表论文1篇',NULL,NULL,NULL,3,6480,'GPU服务器、并行计算服务器，会并行领域的博士','基于三维光线追踪的实时超声图像模拟','2019-12-16 12:53:10','2019-12-05 00:00:00','明理楼B515',4,'2019-12-16 14:46:36',1,'由于超声进行身体部位的检测时具备高效，实时，对人体无害等特点，在医学领域具有很大的潜力。在超声医师入职的时候会经过培训才能够准确的认识各种病变，但由于没有随时可提供的志愿者来让医师来锻炼如何正确的使用超声探头以及病变的认识，因此我们提出一种基于光线追踪的方式模拟超声成像，使入职医师不需要志愿者且随时随地都可以进行超声探头操作以及身体病变部位的认识。','6'),(111,'','2019KSZ06073',1,2,200531010046,'2020-11-01 00:00:00',3000,'计算机综合实验教学中心',4,'授权专利或公开刊物发表论文或省级以上竞赛获奖。','[\"6\"]','[\"24\",\"25\",\"27\",\"28\"]',NULL,3,500,'实验中运用压力、红外线传感器、GPS定位模块、蓝牙模块、Android实验平台、 模块于计算机综合实验教学中心进行实验。项目成员都具有嵌入式相关知识以及此实验项目中各自对应部分要求所需的技能。','“关艾”——智能提醒药盒','2019-12-16 12:59:05','2019-12-05 00:00:00','明理楼c1005',6,'2019-12-16 14:46:36',1,'项目主要内容\n（1）提醒携带药盒功能 药盒通过手机蓝牙连接，当药盒和手机断开蓝牙连接时，使手机振动提醒用户检查药盒是否携带，并提供用户“已携带”和“未携带并稍后提醒”以及“未携带并不再提醒”选项，若用户不作选择，手机便会一直振动提醒。 （2）隐秘提醒按时服药功能 药盒盛放一周剂量的药，用户在微信小程序中设置药的种类、一日服用药的剂量以及每次服药的时间及最晚时间并设置提醒时间间隔。每到服药时间，手机和药盒便会振动提醒服药，每隔一段时间间隔提醒一次。若用户在最晚时间未服药，手机便会一直振动，若半小时后仍未服药，手机提示由振动变为鸣叫。 （3）提醒按时装药功能 当检测到药盒内仅剩一次的药物时，便会在手机中振动提醒用户放药入药盒。当药盒内无药时，便会一直振动提醒用户放药直到检测到药盒内药物齐全。\n','6'),(112,'','2019KSZ06074',-4,2,199131010021,'2020-11-01 00:00:00',3000,'计算机综合实验教学中心',4,'授权专利或公开刊物发表论文或省级以上竞赛获奖。','[\"6\"]','[\"24\",\"25\",\"27\",\"28\"]',NULL,3,500,'实验中运用压力、红外线传感器、GPS定位模块、蓝牙模块、Android实验平台、 模块于计算机综合实验教学中心进行实验。项目成员都具有嵌入式相关知识以及此实验项目中各自对应部分要求所需的技能。','“关艾”——智能提醒药盒','2019-12-16 13:02:32','2019-12-05 00:00:00','明理楼c1005',6,'2019-12-16 14:46:36',1,'项目主要内容\n（1）提醒携带药盒功能 药盒通过手机蓝牙连接，当药盒和手机断开蓝牙连接时，使手机振动提醒用户检查药盒是否携带，并提供用户“已携带”和“未携带并稍后提醒”以及“未携带并不再提醒”选项，若用户不作选择，手机便会一直振动提醒。 （2）隐秘提醒按时服药功能 药盒盛放一周剂量的药，用户在微信小程序中设置药的种类、一日服用药的剂量以及每次服药的时间及最晚时间并设置提醒时间间隔。每到服药时间，手机和药盒便会振动提醒服药，每隔一段时间间隔提醒一次。若用户在最晚时间未服药，手机便会一直振动，若半小时后仍未服药，手机提示由振动变为鸣叫。 （3）提醒按时装药功能 当检测到药盒内仅剩一次的药物时，便会在手机中振动提醒用户放药入药盒。当药盒内无药时，便会一直振动提醒用户放药直到检测到药盒内药物齐全。','6'),(113,'2019KSP06034','2019KSZ06075',4,1,201999010159,'2020-06-01 00:00:00',5000,'图像处理与并行计算实验室',1,'公开发表论文1篇',NULL,NULL,NULL,3,6480,'具备GPU服务器、并行计算服务器等','基于彩色多普勒超声心动图左心室血流场可视化方法','2019-12-16 16:34:55','2019-12-05 00:00:00','明理楼B515',4,'2019-12-23 16:52:58',1,'心血管病成为目前重大的公共问题，心血管疾病的产生往往与心腔血液流动模式异常等密切联系。超声检测身体部位时具有实时、便捷、价格低廉等优点，是诊断心脏疾病常用的成像急速。基于此，我们使用彩色多普勒超声心动图，根据质量守恒定律结合流体力学中连续性方程，对心脏左心室的血流模式进行研究，研究结果用以作为心脏疾病判断治疗的重要参考。','6'),(114,'2019KSP06035','2019KSZ06076',4,1,200631010036,'2020-06-01 00:00:00',5000,'图像处理与并行计算实验室',1,'发表论文一篇',NULL,NULL,NULL,3,6480,'专业医生作为顾问\n并行计算GPU服务器：K20c、M2090、 泰坦V、泰坦Xp\n台式电脑2台','超声弹性成像全局应变估计算法的研究及应用','2019-12-16 16:38:48','2019-12-05 00:00:00','明理楼B515',4,'2019-12-23 16:52:58',1,'(1)使用FieldII模拟RF数据；\n(2) 由于该算法是在基于Horn-Schunck光流估计的框架下提出的，因此首先要了解光流法的原理。并且将该算法计算出的结果与基于窗口的估计算法（快速归一化互相关算法和子采样位移估计算法）进行比较，主要比较位移场的误差和方差、应变场的质量以及计算效率三个方面。\n','6'),(115,'','2019KSZ06077',-3,1,199531010023,'2020-06-01 00:00:00',5000,'图像处理与并行计算实验室',1,'公开发表论文1篇',NULL,NULL,NULL,3,6480,'GPU服务器、并行计算服务器，会并行领域的博士','基于三维光线追踪的实时超声图像模拟','2019-12-16 16:39:14','2019-12-05 00:00:00','明理楼B515',4,'2019-12-24 18:41:30',1,'由于超声进行身体部位的检测时具备高效，实时，对人体无害等特点，在医学领域具有很大的潜力。在超声医师入职的时候会经过培训才能够准确的认识各种病变，但由于没有随时可提供的志愿者来让医师来锻炼如何正确的使用超声探头以及病变的认识，因此我们提出一种基于光线追踪的方式模拟超声成像，使入职医师不需要志愿者且随时随地都可以进行超声探头操作以及身体病变部位的认识。','6'),(116,'','2019KSZ07003',-2,2,201699010069,'2020-11-01 00:00:00',3000,'电工和电气信息实验教学中心',3,'申请发明专利一项；录用或发表期刊论文一篇；研究报告一份。',NULL,NULL,NULL,3,120,'高电压技术实验室，Aspen Hysys ,pipeline studio软件','海上油气平台群混合储能系统设计与优化运行','2019-12-16 18:08:11','2019-12-05 00:00:00','明理楼C410',6,'2019-12-19 09:39:33',1,'以陆上压缩天然气储能和压缩空气储能模型为依托，结合海上石油开采的特点，利用枯竭的油气井建立伴生气储库模型。构建储电、储气二者联合的混合储能系统，并对其进行设计优化，提高海上油气平台群运行的经济性和环保性。主要研究内容为：（1）研究伴生气储库（associated gas storage, AGS）特性，主要是包括伴生气储库的结构和工作原理，以及适用场景分析。\n（2）在目前海上平台储能系统的发展现状基础上，利用伴生气储库的特性，提出电-气混合储能系统的构建方案，为后面混合储能系统的优化运行提供理论依据。\n（3）为了进一步实现在混合储能系统在海上平台群的应用，提出考虑经济性与环保性约束条件的混合储能系统优化运行策略，通过协调储电系统、伴生气储库二者的运行，降低海上油气平台的生产成本和二氧化碳排放量。\n','7'),(117,'2019KSP06036','2019KSZ06078',4,1,201999010029,'2020-06-01 00:00:00',500,'创数据团队实验室',4,'软件（基于机器学习的恶意代码分类Web项目）1个，项目报告1份',NULL,NULL,NULL,4,1000,'PC机，模型训练集，前端开发框架用Vue或React，后端采用SpringBoot，SpringSecurity等技术栈，机器学习采用决策树，随机森林等算法。','基于机器学习的恶意代码自动化分析系统','2019-12-16 18:44:11','2019-12-05 00:00:00','明理楼C1108',4,'2019-12-23 16:52:57',2,'本项目主要研究内容为：\n1.利用机器学习技术，通过模型训练，提升恶意代码的静态分析技术，改善传统的静态分析技术对恶意代码查杀的滞后性，提高恶意代码检测的效率和精确度。\n2.研究和设计基于机器学习技术的自动分类器，结合数据挖掘技术，形成区别恶意代码与正常代码的标准，在此基础上，分析恶意代码转换的二进制文件产生的灰度图像，根据图像特征对未知的二进制代码进行检测和分类。\n3.使用机器学习算法区分恶意代码二进制文件中普通代码所不具备的恶意行为，例如下载器和启动器。通过机器训练模型对其进行分类。\n4.研究与开发基于一套调用训练好的机器学习模型的前后端分离web系统（282字）','6'),(118,'','2019KSZ07004',-2,1,200631010050,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实物作品、实验报告','[\"7\"]',NULL,'[2017,2018]',3,60,'1. 三路直流稳压电源；\n2. 信号发生器；\n3. 示波器；','程控数字电流源的设计与制作','2019-12-18 09:56:55','2019-12-05 00:00:00','明理楼A311A',6,'2019-12-24 15:58:46',1,'1.通过查阅资料，了解电流源的工作原理；\n2.自学单片机原理，要求能够实现题目程序开发（主要包括ADC、DAC、按键等子程序）；\n3.利用Protues设计并仿真电路；\n4.利用Altium实现电路的PCB的设计与制作；\n5.电路调试；\n6.报告撰写。','7'),(119,'2019KSP07001','2019KSZ07005',4,1,200631010050,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实物作品、实验报告','[\"7\"]',NULL,'[2017,2018]',3,60,'1. 三路直流稳压电源；\n2. 信号发生器；\n3. 示波器；\n','D类功率放大器的设计与制作','2019-12-18 09:58:18','2019-12-05 00:00:00','明理楼A311A',6,'2019-12-25 17:39:52',1,'1.通过查阅资料，了解放大器分类以及工作原理；\n2.利用Altium进行电路设计；\n3.电路的PCB的设计与加工；\n4.电路调试；\n5.报告撰写。','7'),(120,'2019KSP07002','2019KSZ07006',4,1,200631010050,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实物作品、实验报告','[\"7\"]',NULL,'[2017,2018]',3,60,'\n1.通过查阅资料，了解基于超声波的传输音频的工作原理；\n2.利用Altium设计电路；\n3.电路的PCB的设计与制作；\n4.电路调试；\n5.报告撰写。','基于超声波的定向音响系统设计与制作','2019-12-18 09:59:48','2019-12-05 00:00:00','明理楼A311A',6,'2019-12-25 17:39:52',1,'1.通过查阅资料，了解基于超声波的传输音频的工作原理；\n2.利用Altium设计电路；\n3.电路的PCB的设计与制作；\n4.电路调试；\n5.报告撰写。','7'),(121,'2019KSP07003','2019KSZ07007',4,1,198131010018,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'\n实物作品、实验报告','[\"7\"]',NULL,'[2017,2018]',3,60,'1. 三路直流稳压电源；\n2. 信号发生器；\n3. 示波器；\n','DC 5V转正负DC 12V的电路设计与制作','2019-12-18 10:06:10','2019-12-05 00:00:00','明理楼C312',6,'2019-12-25 17:39:52',1,'1.通过查阅资料，了解直流电压源的工作原理；\n2.设计一个电源，其输入为正直流5V，要求输出为正负直流12V，输出电流大于1A、输出纹波小于10mV；\n3.利用Altium实现电路的PCB的设计与制作；\n4.电路安装与调试；\n5.报告撰写。','7'),(122,'2019KSP07004','2019KSZ07008',4,1,198131010018,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实物作品、实验报告','[\"7\"]',NULL,'[2017,2018]',3,60,'1. 三路直流稳压电源；\n2. 信号发生器；\n3. 示波器；\n','基于AD9834的信号发生器设计与制作','2019-12-18 10:08:30','2019-12-05 00:00:00','明理楼C312',6,'2019-12-25 17:39:52',1,'1.通过查阅资料，了解AD9834的工作原理；\n2.自学单片机原理，要求能够实现题目程序开发，基本要求能够输出方波、矩形波、正弦波、三角波，频率和幅度能够调节。拓展要求能够输出调制波形；\n3.利用Altium实现电路的PCB的设计与制作；\n4.电路调试；\n5.报告撰写。','7'),(123,'','2019KSZ07009',-2,1,200531010052,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'实验报告、软硬件成果','[\"7\"]','[\"31\"]','[2018]',5,60,'常用的元器件、各种仪器、实验箱','交通灯控制电路设计','2019-12-18 10:30:17','2019-12-05 00:00:00','明理楼C411',6,'2019-12-18 20:00:49',1,'1. 设计一个十字路口的交通灯控制电路，要求甲车道和乙车道两条交叉道路上的车辆交替运行，每次通行时间都设为25秒。\n2. 要求黄灯先亮5秒钟，才能变换运行车道；\n3. 黄灯亮时，要求每秒钟闪亮一次。','7'),(124,'','2019KSZ07010',-2,1,200531010052,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'实验报告、软硬件成果','[\"7\"]','[\"31\"]','[2018]',5,60,'常用元器件、实验箱、常用电子仪器等','数字电子钟的设计与仿真','2019-12-18 10:33:41','2019-12-05 00:00:00','明理楼C411',6,'2019-12-18 20:01:50',1,'①具有\"秒\"、\"分\"、\"时\"计时的功能，小时计数器按24小时制计时.\n②具有校时的功能，能够对\"分\"和\"小时\"进行调整。\n③选做闹时系统和数字万年历系统。','7'),(125,'','2019KSZ07011',-2,1,200531010052,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'实验报告、软硬件成果','[\"7\"]','[\"31\"]','[2018]',5,60,'常用元器件、实验箱、常用电子仪器等','脉搏计的设计','2019-12-18 10:39:07','2019-12-05 00:00:00','明理楼C411',6,'2019-12-18 20:01:50',3,'用传感器将脉搏的跳动转换为电压信号，并加以放大、整形和滤波。\n·在短时间内（15s）测出每分钟的脉搏数。','7'),(126,'2019KSP07005','2019KSZ07012',4,1,200731010054,'2020-06-01 00:00:00',500,'电工与电气实验教学中心',3,'开放性实验报告，作品展示',NULL,NULL,NULL,3,60,'电工电子综合试验台，直流稳压电源，示波器等','裁判判决电路的设计','2019-12-18 11:09:39','2019-12-05 00:00:00','明理楼C312',6,'2019-12-25 17:39:52',1,'实现对三个裁判判决的表决预判断，判决通过亮绿灯，否则亮红灯','7'),(127,'','2019KSZ07013',-2,1,200731010054,'2020-06-01 00:00:00',500,'电工与电气实验教学中心',3,'开放性实验总结报告，实物作品',NULL,NULL,NULL,4,60,'电工与电子综合实验台，直流稳压电源等','电子密码锁的校验设计','2019-12-18 11:18:22','2019-12-05 00:00:00','明理楼C312',6,'2019-12-24 15:58:46',1,'电子密码锁的校验设计由输入密码、设定密码等电路组成，当输入密码正确则发光二极管亮，否则不亮。','7'),(128,'2019KSP07006','2019KSZ07014',4,1,200731010054,'2020-0