019-12-25 17:40:04',1,'应用ABB变频器的安装使用说明，设计通过变频器对三相异步电动机进行调速控制。涉及三相四线制供电电源，配电电器，控制电器及变频器的基本应用，学习和体会电动机、变频器、配电电器、控制电器的工业现场应用。','7'),(134,'','2019KSZ07020',-2,1,200431010073,'2020-06-01 00:00:00',500,'电力系统综合自动化实验室',2,'三相交流同步发电机的并网操作现场培训，现场操作，三相交流同步发电机准同期并网操作实验报告。','[\"7\",\"5\"]','[\"32\",\"30\",\"31\",\"33\",\"23\"]',NULL,4,6,'周一～周五工作日全天开放；周六、周日开放需提前申请。','三相交流同步发电机的准同期并网操作实验','2019-12-18 16:30:49','2019-12-05 00:00:00','明理楼C208',6,'2019-12-24 15:58:45',1,'三相交流同步发电机准同期并网条件，三相交流同步发电机的调速与励磁建压，同步发电机准同期并网操作，三相交流同步发电机带负载实验。','7'),(135,'2019KSP07011','2019KSZ07021',4,1,200831010089,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'实验作品、实验报告',NULL,NULL,NULL,5,60,'单片机 STC89C52、面包板、LCD显示屏、蜂鸣器、三极管、二极管，PC机一台','记忆力测试评分系统','2019-12-18 16:33:38','2019-12-05 00:00:00','C312',6,'2019-12-25 17:40:04',1,'利用单片机通过P1端口控制led的灯的功能，考虑制作一个瞬间记忆力测试机，该测试机的原理是通过对亮灯顺序来复现测试用户的记忆能力，每个LED灯对应一个按钮，先随机点亮发光二极管中的几只，然后用户通过触及按钮来检测是否记住了亮灯的顺序。主要需要用到单片机，需要熟悉单片机各个引脚的功能，以及了解单片机的编程。','7'),(136,'2019KSP07012','2019KSZ07022',4,1,200431010073,'2020-06-01 00:00:00',500,'新能源转换与控制实验室',2,'光伏发电系统组成，风力发电系统组成，直流负载与交流负载供电实验，风光互补发电系统实验报告。','[\"7\",\"5\"]','[\"30\",\"31\",\"32\",\"33\",\"23\"]',NULL,4,6,'周一－周五全天候开放。','光伏与风力互补发电带负载实验','2019-12-18 16:37:19','2019-12-05 00:00:00','明理楼C110室',6,'2019-12-25 17:40:04',1,'光伏发电系统、风力发电系统的搭建，互补蓄能与离网逆变控制，带直流负载，带交流负载实验。','7'),(137,'','2019KSZ07023',-2,1,201899010088,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放实验报告、作品实物演示。',NULL,NULL,NULL,5,60,'万用表、示波器、直流稳压电源、2.5mm黑胶带环形赛道等','基于线性CCD麦克纳姆轮寻迹小车设计','2019-12-18 16:57:38','2019-12-05 00:00:00','明理楼A307',6,'2019-12-24 15:58:45',3,'       基于麦克纳姆轮的运动控制方式是近几年各项机器人竞赛较为火热的移动方式之一，其优点主要是转弯半径小、可平移以及基于机身任意方向的移动。本实验设计任务要求是结合线性CCD传感器，完成对麦克纳姆轮小车对赛道（2.5mm黑线）寻迹，重点在于完成麦克纳姆的驱动控制算法设计、线性CCD路径识别算法设计以及PID控制算法设计等。','7'),(138,'2019KSP07013','2019KSZ07024',4,1,200631010049,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放实验报告、作品',NULL,NULL,NULL,5,60,'计算机、函数信号发生器、示波器、直流稳压电源、数字万用表等','数字脉搏测试仪','2019-12-18 17:01:41','2019-12-05 00:00:00','明理楼C312',6,'2019-12-25 17:40:04',1,'数字脉搏测试仪时用来测量人心脏跳动次数的电子仪器，也是心电图的主要组成部分。本次设计需要用传感器将脉搏的跳动转换成电信号，并加以放大、整形和滤波，最后通过计数、译码将脉搏数显示出来。','7'),(139,'2019KSP07014','2019KSZ07025',4,1,200831010089,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'焊接作品、实验报告',NULL,NULL,NULL,5,60,'电路板、LM35、ICL7135、74LS95、共阳极数码管、电脑一台用于电路图仿真','数显电子精密测温计的设计和制作 ','2019-12-18 17:04:04','2019-12-05 00:00:00','C312',6,'2019-12-25 17:40:04',1,'本实验主要使学生了解如何使用温度传感器LM35来测量水温，并如何将水温显示出来。首先使用仿真软件设计电路图，然后用电路板焊接设计好的电路，并进行调试实验，对比普通的水温计观测实验效果。','7'),(140,'','2019KSZ07026',1,2,201899010088,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'开放性实验报告、实物成果演示，实用新型专利一篇。',NULL,NULL,NULL,5,120,'万用表、DDS函数信号发生器、直流稳压电源、示波器、恒温焊台、PC等。','基于CAN总线直流有刷电机驱动设计','2019-12-18 17:17:52','2019-12-05 00:00:00','明理楼A305',6,'2019-12-20 14:19:22',3,'       设计一个基于CAN总线通信的直流有刷电机驱动器，驱动器向外提供一个CAN总线接口用于和外部控制器之间进行通信，并可通过总线反馈电机实时速度以便于外部控制器对电机进行实时控制，该驱动器上提供完整的电机接口(电机电源接口、编码器接口)。此驱动器通过板载接口直接与传统带编码器的直流有刷电机连接，并在内置控制器上集成电机控制算法，可以极大的减小多个直流有刷电机控制系统布线和控制问题。','7'),(141,'','2019KSZ07027',-2,1,200831010089,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',4,'软件代码、实验报告',NULL,NULL,NULL,5,60,'PC一台配置visual studio 2010以上版本，sqlserver 数据库','实验耗材使用预约领取系统','2019-12-18 17:22:58','2019-12-05 00:00:00','C312',6,'2019-12-24 15:58:45',1,'使用C#语言编写一个实验室耗材领取系统。该系统使用B/S结构，主要功能有：查询实验室现有的耗材所在地，记录新增耗材情况，记录耗材领取状况，预约领用功能，统计使用情况等。','7'),(142,'2019KSP07015','2019KSZ07028',4,1,201899010088,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放实验报告、实物作品演示',NULL,NULL,NULL,5,60,'直流稳压电源、万用表、示波器、OpenMV摄像头、PC等。','基于OpenMV目标物体检测跟踪算法研究','2019-12-18 17:29:34','2019-12-05 00:00:00','明理楼A307',6,'2019-12-25 17:40:04',3,'       目前OpenMV以其运行内存小、入门难度低及开发周期短等优点成为机器视觉基础研究必备之一。本实现目的在于基于OpenMV完成对目标图像识别检测，完成OpenMV和主控MCU的通信算法设计，即将目标物体的位置信息传递给MCU，以控制机身对目标物体的追踪。','7'),(143,'','2019KSZ07029',1,2,200431010073,'2020-11-01 00:00:00',3000,'新能源转换与控制实验室',1,'发明专利1项或科技论文1篇，电子设计装置一套，实验报告一份。','[\"7\",\"5\",\"3\"]','[\"30\",\"31\",\"32\",\"33\",\"23\",\"13\"]',NULL,5,60,'周一～周五全天开放。周六、周日开放需提前申请。','公共通道／楼梯间自动照明控制装置设计','2019-12-18 17:35:14','2019-12-05 00:00:00','明理楼C110',6,'2019-12-20 14:18:55',1,'检测楼道或公共通道的光照度值，在光照度值高于设定值时，不照明；在光照度值低于设定值，根据检测到人员移动方向，自动打开人员移动方向前面的照明，自动关闭后面的灯，达到自动照明，节能的目的。适合住宅楼梯间，公共建筑通道的照明控制。','7'),(144,'','2019KSZ07030',-2,1,200531010052,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'实验报告，软硬件实物','[\"7\"]','[\"31\"]','[2018,2017]',5,60,'常用的元器件、各种仪器、实验箱','交通灯控制电路设计','2019-12-18 20:07:44','2019-12-05 00:00:00','明理楼C411',6,'2019-12-24 15:58:45',2,'1. 设计一个十字路口的交通灯控制电路，要求甲车道和乙车道两条交叉道路上的车辆交替运行，每次通行时间都设为25秒。 2. 要求黄灯先亮5秒钟，才能变换运行车道； 3. 黄灯亮时，要求每秒钟闪亮一次','7'),(145,'2019KSP07016','2019KSZ07031',4,1,200531010052,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'实验报告、软硬件成果','[\"7\"]','[\"31\",\"32\"]','[2018,2017]',5,60,'常用元器件、实验箱、常用电子仪器等','数字电子钟的设计与仿真','2019-12-18 20:12:56','2019-12-05 00:00:00','明理楼C411',6,'2019-12-25 17:40:04',2,'\n①具有\"秒\"、\"分\"、\"时\"计时的功能，小时计数器按24小时制计时. ②具有校时的功能，能够对\"分\"和\"小时\"进行调整。 ③选做闹时系统和数字万年历系统。','7'),(146,'2019KSP07017','2019KSZ07032',4,1,200531010052,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'实验报告、软硬件成果','[\"7\"]','[\"31\",\"32\"]','[2018,2017]',5,60,'常用元器件、实验箱、常用电子仪器等','脉搏计的设计','2019-12-18 20:17:29','2019-12-05 00:00:00','明理楼C411',6,'2019-12-25 17:40:04',2,'用传感器将脉搏的跳动转换为电压信号，并加以放大、整形和滤波。 ·在短时间内（15s）测出每分钟的脉搏数。','7'),(147,'','2019KSZ07033',-2,1,200731010110,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实验报告、实物作品','[\"7\"]',NULL,NULL,3,60,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','多路直流电源模块的设计与制作','2019-12-18 20:46:02','2019-12-05 00:00:00','明理楼A305',6,'2019-12-20 14:15:39',1,'利用三端稳压集成芯片制作一款3路输出电压可调的直流稳压电源，其中2路输出1.5V~20V，最大电流1A，1路输出-1.5V~-20V，最大电流1A。各年级同学均可选择。','7'),(148,'','2019KSZ07034',-2,1,200731010110,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实验报告、实物作品','[\"7\"]',NULL,NULL,3,60,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','DDS信号发生器的设计与制作','2019-12-18 21:02:55','2019-12-05 00:00:00','明理楼A305',6,'2019-12-20 14:15:39',1,'利用DDS芯片设计和制作一款具有多种函数波形输出能力的信号发生器，可输出正弦波、三角波、锯齿波等，输出频率在1Hz~1MHz范围内连续可调。推荐大二或更高年级同学选题。','7'),(149,'','2019KSZ07035',-4,2,201699010118,'2020-11-01 00:00:00',5000,'电工与电气信息实验教学中心',2,'六足蚁型仿生机器人样机一部，开放性实验报告一份。','[\"7\"]',NULL,NULL,5,120,'Leap Motion体感控制器、Arduino控制板、数字/模拟舵机、3D打印机等。','基于Leap Motion体感操控的蚁型仿生机器人','2019-12-18 21:31:59','2019-12-05 00:00:00','明理楼A205',6,'2019-12-20 14:18:45',2,'本实验要求实现一种驱动六足仿生机器人运动的方法。运用Leap Motion体感控制器开发新型的人机交互模式，采集人的手部动作信息，经过程序运行与手势分析后，利用蓝牙通讯传输给arduino控制板，控制机器人运动。使用手势映射，使其按操作者意愿做出相应行走、停止、转动等动作，感知距离并作出反应。编辑步态算法，完成复杂的运动过程。该设计可切换为软件控制模式。实验要求设计的机器人运动灵活，便于操纵，腿部自由度较高，主要用于搭载传感器执行远程遥控、数据采集、勘察探测，同时还可以用于高等学校工科院系的人机交互教学，以及基于体感控制器的深度开发实例研究。该作品丰富了人机交互应用实例，采用Leap Motion代替了传统的信号输入，同时保留了串口通信的方式。以大蚂蚁作为仿生机器人的原型，突出了其仿生特性。','7'),(150,'','2019KSZ07036',-4,2,201699010119,'2020-11-01 00:00:00',5000,'电工与电气信息实验教学中心',2,'共轴双旋翼飞行器样机一部，开放性实验报告一份。','[\"7\"]',NULL,NULL,5,120,'STM32控制板、碳素钢板材、共轴双旋翼机构传功装置、舵机、电机。','共轴双旋翼飞行器的设计与实现','2019-12-18 21:41:03','2019-12-05 00:00:00','明理楼A205',6,'2019-12-20 14:18:45',2,'本课题以共轴双旋翼直升飞机为设计灵感，要求设计并制造一台微型共轴双旋翼飞行器。飞行器搭载共轴双旋翼动力系统，飞行控制器，惯性导航传感器，云台和摄像机等设备，以保证能够完成空中飞行和低空摄影等规定任务。','7'),(151,'','2019KSZ07037',-2,2,200731010110,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'实物作品、实验指导书、实验报告、相关论文','[\"7\"]',NULL,'[2018,2017,2016]',5,120,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','电子类专业大学生创新实践实验系统的设计与开发','2019-12-19 08:43:37','2019-12-05 00:00:00','明理楼A305',6,'2019-12-20 14:17:00',1,'电子类专业学生的创新实践能力培养目标需要大量的实践操作和相关技能训练才能达成。本开放实验课题需要学生根据相关要求，设计开发一套适用于电子类专业学生创新实践训练、学科竞赛、课程设计、毕业设计的电路实验装置。该装置采用模块化设计，具有电源、微控制器、显示屏、键盘、通信接口、ADDA转换、信号发生、信号检测、放大器、滤波器等常用信号处理及控制模块，模块可独立使用，也可以通过合理组合，搭建一套具有完整功能的电路系统。建议大二及以上学生，尤其是经常参加学科竞赛和其它创新实践活动的同学选题。','7'),(152,'2019KSP07018','2019KSZ07038',4,1,198531010037,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'开放实验报告','[\"7\"]',NULL,NULL,4,60,'实验室具备完成开放实验所需 工具、器材、仪器、及相关场地 ','电动自行车电子里程表设计与制作','2019-12-19 08:59:09','2019-12-05 00:00:00','明理楼A415',6,'2019-12-25 17:40:04',1,'电动自行车电子里程表应具有：\n1．	三位LED数码管与两只发光二极管显示行驶里程，最高可显示1999公里。\n2．	表头设计6个发光二极管，既可以作速度监视，又可以作为每一公里内行驶距离显示。\n3．	路程传感器可选用耐用的霍尔接近开关，与之配合的外磁钢固定于前轮减震器上。\n4．	电动自行车前轮直径为53cm，其周长为166cm，每公里前轮要转600圈。\n5．	所设计的电子里程表应具有低功耗，用电动自行车蓄电池供电。\n6．	要求完成实物制作并调试好。\n','7'),(153,'2019KSP07019','2019KSZ07039',4,1,198531010037,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',3,'开放实验报告','[\"7\"]',NULL,NULL,4,60,'实验室具备完成开放实验所需 工具、器材、仪器、及相关场地 ','工厂流水线产品计数器的设计','2019-12-19 09:02:50','2019-12-05 00:00:00','明理楼A415',6,'2019-12-25 17:40:20',1,'工厂流水线产品计数器：\n设计要求传感器用红外线对管，马达传送带传送物体通过红外线，在数码管上计数。当所需打包的物品计满12个时，传送带停止传送并发出报警声，提醒工作人员打包。几秒后，打包完成，传送恢复工作，报警声停止报警，计数器重新计数，如此循环。\n','7'),(154,'2019KSP07020','2019KSZ07040',4,1,201499010041,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'结题报告一份；实验报告一份。','[\"7\"]','[\"31\"]',NULL,3,3600,'本项目需要学生具备一定的电路设计能力及硬件编程能力。','基于噪声检测的广播音量控制系统设计与实现','2019-12-19 09:05:40','2019-12-05 00:00:00','明理楼A304',6,'2019-12-25 17:40:20',1,'合适的广播音量能使听众接收到更加丰富的有效声音信息。固定音量大小的广播受环境噪声干扰影响较大。本课题要求设计并实现一种基于噪音检测的自适应广播音量控制系统，具体要求：\n（1）设计噪声检测电路，能够有效检测到环境噪声；\n（2）设计声音播报电路，能够播放预先存储的声音（比如歌曲）；\n（3）设计音量调节电路，能够根据检测到的噪声水平调节音量大下。','7'),(155,'2019KSP07021','2019KSZ07041',4,1,201499010041,'2020-06-01 00:00:00',500,'电工与电气信息教学实验中心',2,'结题报告一份；实验研究报告一份。','[\"7\"]','[\"31\"]',NULL,3,3600,'本实验室具有常用的电子元件及电子仪器，方便进行电子电路设计制作及调试。','基于555定时器的呼吸灯设计','2019-12-19 09:18:15','2019-12-05 00:00:00','明理楼A304',6,'2019-12-25 17:40:20',1,'本项目要求根据555定时器的基本原理，设计并制作一种控制LED实现呼吸效果的电子电路。具体要求：\n（1）设计基于555定时器的呼吸灯电路；\n（2）采用Multisim等仿真软件验证设计的电路功能；\n（3）在面包板（或制作PCB）上搭建实物电路，验证设计功能。','7'),(157,'','2019KSZ07042',1,2,201499010041,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'项目结题报告一份；实验研究报告一份；发表论文一篇。','[\"7\"]','[\"31\"]',NULL,3,7200,'本实验室具有项目需要的仪器设备及项目所需的理论知识储备。','基于深度学习的交通流量预测算法研究及实现','2019-12-19 09:25:34','2019-12-05 00:00:00','明理楼A212',6,'2019-12-20 14:18:37',1,'交通流量预测是交通运输规划与管理这一研究领域的核心问题之一，是解决交通拥堵的重要手段。本课题要求研究并实现基于深度学习的交通流量预测，能够基于交通卡口历史数据、路网信息、出租车GPS信息等条件，预测指定卡口在未来某段时间内的交通流量。。具体要求：\n（1）根据提供的某市交通数据，选择合适的方法进行特征（时间、空间等）提取；\n（2）建立基于深度学习的交通流量预测模型；\n（3）选择合适的方法进行交通流量预测，并进行实验对比分析；\n（4）编写程序（matlab、C#、python等）实现。','7'),(158,'','2019KSZ07043',-4,2,200631010050,'2020-11-01 00:00:00',5000,'电工与电气信息实验教学中心',2,'1.实物作品 一件；\n2.发表文章 一篇；\n3.实用新型专利 一项；\n4.参加学科竞赛获奖；','[\"7\"]',NULL,'[2017,2018]',5,120,'1.数字示波器；\n2.信号发生器；\n3.三路直流稳压电源；\n4.“魔法师”创意竞赛平台。','基于物联网的家庭景观智能互联系统','2019-12-19 09:34:02','2019-12-05 00:00:00','明理楼A311A',6,'2019-12-20 14:18:31',2,'以家庭景观为研究对象，利用万物互联的思想，将家中常见的鱼缸、花卉等互联成一个智能互联系统，从而达到家庭景观的智能化生态系统，系统包括：\n1.智能鱼缸管理：全自动智能换水，全自动鱼缸清理，水环境（如温度、PH值、浑浊度）的监测与提示、鱼健康状况监测与提示。\n2.智能花卉管理：盆栽植物的动态观赏，适宜生长环境管理（如阳光、养分，将其移动到合适的位置），鱼缸废弃水智能灌溉。\n3.智能水循环管理：联系花卉与鱼缸，自动处理废水，并利用到需要的地方（如浇花，冲洗厕所）。\n4.手机APP实现人机交互的智能化管理。','7'),(159,'','2019KSZ07044',-2,2,200631010048,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',1,'发表论文，程序开发','[\"6\",\"7\",\"9\",\"10\"]',NULL,'[2016,2017,2018]',3,120,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','某城市电动网约车和出租车充电需求预测 ','2019-12-19 09:38:02','2019-12-05 00:00:00','明理楼A206',6,'2019-12-19 10:03:14',1,'1、对城市道路建立路网模型，要求包括一系列道路状况参数；\n2、分析电动出租车行驶行为；\n3、分析电动网约车行驶行为；\n4、计算不同类型车辆在路网中的点充电需求；\n5、分析分时电价对充电负荷时空分布的影响。\n发表论文\n','7'),(160,'','2019KSZ07045',-2,2,201799010032,'2020-11-01 00:00:00',5000,'电工与电信信息实验室中心',1,'开放性实验报告、作品、论文或专利','[\"7\"]','[\"30\",\"31\",\"32\",\"33\"]',NULL,5,150,'示波器、直流电源、雕刻机、3D打印机等。','基于GPS及IMU的车载组合定位方法研究','2019-12-19 09:56:06','2019-12-05 00:00:00','明理楼C205',6,'2019-12-24 15:33:59',2,'设计一款能够采集GPS、IMU、OBD信息的电路装置、利用上述信息，研究数据融合算法，提取出最佳的车载定位信息。','7'),(185,'','2019KSZ07046',1,2,200231010033,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',1,'开放实验报告及软件著作权或者论文、比赛、专利','[\"7\"]',NULL,'[2016,2017,2018]',5,120,'Matlab或者Python编程软件','无人站场管道故障诊断机器人','2019-12-19 10:58:42','2019-12-05 00:00:00','明理楼A309',6,'2019-12-20 14:18:24',1,'天然气站场承载着输送天然气的重要任务,天然气站场正常运行对于保障天然气正常输送以及天然气站场工作人员与周围居民的生命财产安全非常重要。天然气站场运行压力高、变化不均匀，由于压力波动引起的管线腐蚀和各种偶然性导致的管道裂缝，都存在引发事故的可能。为保障站场安全运行，必须定期对管道进行检查。传统的人工巡查工作量大、效率低，因此本项目提出研发机器人进行管道巡查，实现自动检测和识别。\n  本项目将机器人自动巡线与人工智能相结合，设计出一种基于视频采集的管道智能检测机器人，并开发出配套的软件，可直接输出分类后的管道图像，工作人员可依据分析结果开展下一步工作。\n备注：本项目由李宾倩老师协助指导。','7'),(186,'','2019KSZ07047',-2,2,199831010014,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',1,'发表论文，程序开发','[\"7\",\"6\",\"9\",\"10\"]',NULL,'[2016,2017,2018]',3,120,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。\n','某城市电动网约车和出租车充电需求预测 ','2019-12-19 11:06:23','2019-12-05 00:00:00','明理楼A206',6,'2019-12-24 15:33:59',1,'1、对城市道路建立路网模型，要求包括一系列道路状况参数；\n2、分析电动出租车行驶行为；\n3、分析电动网约车行驶行为；\n4、计算不同类型车辆在路网中的点充电需求；\n5、分析分时电价对充电负荷时空分布的影响。\n发表论文','7'),(187,'','2019KSZ07048',1,2,200831010090,'2020-11-01 00:00:00',5000,'电工与电气信息实验教学中心',2,'机器人样机模型，实验报告。专利或参加比赛获奖。','[\"7\"]','[\"30\",\"32\"]','[2017,2018]',3,60,'实验桌，电源，示波器，万用表，五金工具等，实验耗材。','输气管道外壁攀爬机器人的设计与实现','2019-12-19 11:11:23','2019-12-05 00:00:00','明理楼C205',6,'2019-12-20 14:18:18',1,'  调研露天天然气输气管道，并设计一个可以沿管道外沿攀爬的燃气泄露检测机器人，实现机器人的远程遥控沿管壁前进、后退，转向等功能。\n具体任务如下：\n（1）设计出机器人的机械结构，能适应不同管径，可实现机器人的运动控制。\n（2）设计并制作机器人模型。\n（3）设计机器人控制电路及控制程序。','7'),(188,'2019KSP07022','2019KSZ07049',4,1,200831010090,'2020-06-01 00:00:00',5000,'电工与电气信息实验教学中心',2,'机器人样机模型，实验报告，专利或竞赛获奖','[\"7\"]','[\"30\",\"32\"]','[2017,2018,2019]',3,60,'提供实验桌，示波器，电源，万用表等仪器和五金工具。','室内自动拖地机器人的设计与实现','2019-12-19 11:15:20','2019-12-05 00:00:00','明理楼C205',6,'2019-12-25 17:40:20',1,'调研扫地、拖地设备或机器人的相关技术，设计一个可以在室内自动拖地的机器人，实现机器人自动规划路径进行室内拖地。\n具体任务如下：\n（1）设计出机器人的机械结构。\n（2）设计并制作机器人模型，在模拟的居室环境中（不少于3个房间，总面积不小于6平方米）进行拖地作业。\n（3）设计机器人控制电路及控制程序。','7'),(189,'','2019KSZ07050',-2,1,200631010048,'2020-06-01 00:00:00',500,'电工与气信息实验教学中心',2,'实物作品或研制报告、实验报告','[\"7\",\"6\"]',NULL,NULL,3,60,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。',' 模块化交通灯控制系统的设计与实现','2019-12-19 11:35:15','2019-12-05 00:00:00','明理楼A206',6,'2019-12-24 15:58:45',1,'模块化设计包含组合逻辑电路设计、时序逻辑电路设计、555电路应用、可编程逻辑器件编程、电路仿真等。系统整体设计包含实验系统硬件电路设计、交通灯控制方案设计、实验系统界面设计等知识的综合应用。','7'),(193,'2019KSP07023','2019KSZ07051',4,1,200631010048,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实物作品或研制报告、实验报告','[\"6\",\"7\"]',NULL,'[2016,2017,2018]',3,60,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','变电站巡检机器人关键技术研究','2019-12-19 11:51:01','2019-12-05 00:00:00','明理楼A206',6,'2019-12-25 17:40:19',1,'对变电站电气设备进行定期巡视，迅速获得变电设备的状态信息并及时发现变电设备的缺陷和隐患，是保障变电站的安全稳定运行的关键。当今智能电网的建设推进了变电站无人化的发展进程，利用变电站自动巡检机器人取代人工对变电设备状态进行检测是一种便捷、可靠和经济的技术手段。实验要求依托学院机器人群集智能控制教学平台开展，结合变电站运行场景及任务要求，完成巡检机器人关键技术研究与开发','7'),(194,'','2019KSZ07052',-2,2,201899010089,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'开放性实验报告、作品、比赛获奖','[\"7\"]',NULL,NULL,5,120,'实验室具备完成开发实验所需工具、器材、仪器及相关场地','解魔方机器人的设计','2019-12-19 14:13:45','2019-12-05 00:00:00','明理楼A202',6,'2019-12-24 15:33:59',1,'近年来智能机器人逐渐走进人们的日常生产和生活，而解魔方机器人因其无与伦比的趣味性和交互性，正成为人工智能的研究热点。解魔方机器人是集机器人视觉、机器人控制技术、图像处理、虚拟现实交互、魔方还原算法等多学科知识于一体的综合性机器人，对促进机器人的智能化发展具有重要的科学意义和研究价值。','7'),(195,'','2019KSZ07053',-2,2,199131010023,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'开放性实验报告、作品、比赛获奖','[\"7\"]',NULL,NULL,3,120,'实验室具备完成开发实验所需工具、器材、仪器及相关场地','钢琴演奏机器人的设计','2019-12-19 14:16:45','2019-12-05 00:00:00','明理楼C412',6,'2019-12-24 15:33:59',1,'随着机器人技术的快速发展，其应用领域也在不断拓展，音乐机器人是机器人发展的一个重要方向，同时也是机器人技术应用于民用领域的一个典型代表，它将音乐这一人类共同的语言通过机器人演奏的方式表现出来，具有很强的趣味性。钢琴是西洋古典音乐中的一种键盘乐器，有“乐器之王”的美称。钢琴演奏机器人通过手指动作模仿人类在琴键上的弹奏过程。它是集机械、电子、信号处理，自动控制、计算机科学、音乐等学科于一体的综合性机器人，完美体现了艺术与现代科技的交互融合，对促进机器人的智能化发展具有重要的科学意义和研究价值。','7'),(196,'2019KSP07024','2019KSZ07054',4,1,199131010023,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放性实验报告、作品',NULL,NULL,NULL,3,60,'实验室具备完成开发实验所需工具、器材、仪器及相关场地','基于总线控制的无刷直流电机驱动器的设计','2019-12-19 14:18:45','2019-12-05 00:00:00','明理楼C412',6,'2019-12-25 17:40:19',1,'随着控制科学、计算机科学、网络及通信技术的发展和交叉渗透，运动控制系统经历了从直流到交流，从开环到闭环，从模拟到数字，直到基于总线的运动控制的发展过程。RS485总线是一种常见的串行总线标准，其采用平衡发送与差分接收的方式，具有极强的抑制共模干扰的能力。无刷电机具备的使用寿命长、控制性能好、维护成本低等优势，被广泛应用于各种动力器件中。通过总线实现电机的远程控制，已经成为电机运动控制系统的研究方向之一。','7'),(197,'','2019KSZ07055',-2,1,199131010023,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放性实验报告、作品','[\"7\"]',NULL,NULL,3,60,'实验室具备完成开发实验所需工具、器材、仪器及相关场地','一种基于双目立体视觉的测距系统','2019-12-19 14:20:12','2019-12-05 00:00:00','明理楼C412',6,'2019-12-24 15:58:45',1,'双目立体视觉是计算机视觉中的一个重要分支,即由不同位置的两台相机经过平移或者旋转来拍摄同一场景,通过计算空间点在两幅图像中的视差,来获取空间点的三维坐标值。双目立体视觉模拟人类双眼来进行判断与处理,具有简单易行的优点,在位姿检测与控制、非接触测量等领域得到了广泛应用。','7'),(198,'2019KSP07025','2019KSZ07056',4,1,199131010023,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放性实验报告、作品','[\"7\"]',NULL,NULL,3,60,'实验室具备完成开发实验所需工具、器材、仪器及相关场地','支持总线控制的有刷直流电机驱动器的设计','2019-12-19 14:21:47','2019-12-05 00:00:00','明理楼C412',6,'2019-12-25 17:40:19',1,'随着控制科学、计算机科学、网络及通信技术的发展和交叉渗透，运动控制系统经历了从直流到交流，从开环到闭环，从模拟到数字，直到基于总线的运动控制的发展过程。相比于离散控制，总线控制具有节省硬件数量和安装费用、维护开销少、使用简单、抗干扰能力更强等优势。有刷直流电机具有结构简单，操控方便，成本低廉，良好启动和调速性能等优点，被广泛应用于各种动力器件中。通过总线实现电机的远程控制，已经成为电机运动控制系统的研究方向之一。','7'),(199,'2019KSP07026','2019KSZ07057',4,1,201899010089,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放性实验报告、作品',NULL,NULL,NULL,3,60,'实验室具备完成开发实验所需工具、器材、仪器及相关场地','一种智能分类垃圾箱的设计','2019-12-19 14:23:18','2019-12-05 00:00:00','明理楼A202',6,'2019-12-25 17:40:19',1,'人们生活水平的不断提高，产生了大量种类繁多的生活垃圾，又由于很大一部分人不具备垃圾分类的知识和意识，因此设计一种可以帮助人们分类的垃圾箱很有意义。它能通过语音提示或其它技术手段帮助人们进行垃圾分类，替代了人们手动分类的工作。智能分类垃圾箱是一个集机械、电子、信息处理、自动控制、智能技术等学科于一体的综合性应用产品，对垃圾的有效分类和环境保护具有很好的使用价值。','7'),(200,'2019KSP07027','2019KSZ07058',4,1,201899010089,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放性实验报告、作品',NULL,NULL,NULL,3,60,'实验室具备完成开发实验所需工具、器材、仪器及相关场地','基于视觉的分拣装置的设计','2019-12-19 14:24:48','2019-12-05 00:00:00','明理楼A202',6,'2019-12-25 17:40:19',1,'随着物流和仓储行业的快速发展，传统的物流、仓储行业需要越来越多的资源投入。人工分拣不仅耗费大量的人力物力，而且分拣的效率也不是很高。所以设计一种分拣装置来减少人力物力，提高分拣效率很有意义。该分拣装置以单片机为控制器，搭建一定的机械结构，并通过摄像头对物品颜色进行识别，进而实现物品的识别、搬运、分拣等目的。','7'),(201,'','2019KSZ07059',-4,2,200731010054,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'1.实物作品；\n2.文章一篇；\n3.实用新型专利一项','[\"7\"]',NULL,'[2017,2018]',5,120,'1.示波器；\n2.函数信号发生器；\n3.三路直流稳压电源；\n4.“魔法师”创意竞赛平台。','智能商场导购机器人设计与制作','2019-12-19 14:25:18','2019-12-05 00:00:00','明理楼A311A',6,'2019-12-20 14:18:11',2,'通过平时逛商场的观察，发现顾客在逛商场时存在的不了店铺是否发布新品、是否有促销活动等问题，以解决这些问题为目的，提出设计一款商场智能导购机器人，该机器人具有以下主要功能：\n    1. 能够存放一定的商品货物，以便解放顾客双手；\n2. 能够自主避障，自主定位；\n3. 能够推送商场中店铺信息，以便顾客能够更及时了解店铺的是否发布新品、是否有促销活动、店铺的特色等等；\n4. 能够自主跟随；\n5. 能够进行必要的信息交换。','7'),(202,'','2019KSZ07060',1,2,201899010035,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',1,'开放实验报告1份；监测装置样机；论文1篇','[\"7\"]','[]',NULL,5,120,'实验室具备完成开放实验所需工具、器材、仪器及相关场地','海上油气平台变压器全景状态实时感知装置及状态评估方法','2019-12-19 14:58:41','2019-12-05 00:00:00','明理楼C410',6,'2019-12-20 14:18:00',1,'针对现有变压器监测设备监测量单一、状态评价不准确的问题，研发基于云边端一体化协同计算的海上油气平台变压器全景状态感知装置及状态评估方法。硬件构成方面，主要由一个控制主机和多个传感器从机组成，其中传感器包括温湿度、振动、超声波等；装置具有防水、防爆保护设计，能适应各种复杂工作环境，同时经过更改传感器种类和数量可实现不同型号变压器的检测评估，可实现变压器的多种特征数据的实时采集、分析处理及数据远传；在此基础上，装置内部采用主从式多机通信，通过较为新颖的电源总线设计，在简化通信方式的同时解决了从机的供电问题；装置、外部设备及后台之间可采用RS485有线通信方式和LORA无线通信方式，使用户对现场作业情况实行远程监控，提高相关作业的智能水平。研究变压器的故障诊断和状态评估方法，实现阈值报警及趋势报警，有效提高设备状态的掌控能力，降低了设备维护、检修成本。','7'),(203,'','2019KSZ07061',-2,1,201031010006,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实物作品、实验报告',NULL,'[\"30\",\"31\",\"32\",\"33\"]','[2018]',5,60,'1. 三路直流稳压电源；\n2. 信号发生器；\n3. 示波器；','交通灯控制电路','2019-12-19 15:26:30','2019-12-05 00:00:00','明理楼C412',6,'2019-12-24 15:58:45',2,'1. 掌握555定时器、计数器、门电路的基本运用；\n2.了解电源电路的工作原理。\n3. 利用Multisim实现电路仿真；\n4. 电路安装与调试；\n5. 报告撰写。','7'),(204,'','2019KSZ07062',-2,2,200631010049,'2020-11-01 00:00:00',5000,'电工与电气信息实验教学中心',2,'开放实验报告、实物作品、学科竞赛获奖或文章或专利。','[\"7\"]','[\"30\",\"31\",\"32\",\"33\"]',NULL,5,120,'示波器、直流电源、焊台、雕刻机、3D打印机等。','基于麦克纳姆轮的全向平衡移动平台设计','2019-12-19 15:41:32','2019-12-05 00:00:00','明理楼C205',6,'2019-12-24 15:33:59',2,'基于麦克纳姆轮的全向运动原理，设计一款平衡移动机构，通过陀螺仪以及加速度计信息进行数据融合，从而得到平衡装置的姿态信息，基于姿态信息进行平衡状态的闭环控制，同时利用麦克纳姆轮的全向移动特性，进行全向运动控制。','7'),(205,'','2019KSZ07063',1,2,200631010048,'2020-11-01 00:00:00',3000,'电工与电气信息实践教学中心',2,'制作产品、发表专利或论文','[\"7\",\"6\"]',NULL,'[2018,2017]',5,120,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','云叫水服务平台设计与实现','2019-12-19 15:41:52','2019-12-05 00:00:00','明理楼A306',6,'2019-12-20 14:53:33',1,'实验目的是研发一款将“互联网+”+“送水服务”相结合的“云”叫水服务平台。该平台主要包括硬件和软件两个部分。硬件部分包含对办公或家庭桶装用水储量自动检测，当储量不足时自动报警并通过4G或局域网申请叫水服务。软件部分，主要实现实时监测叫水服务申请，以就近配送原则，将用户叫水需求信息发送给附近水站，且能完成相应桶装水计价，用户能在线支付，后台能统计配送完成情况和需求数据统计，方便水站部署和调整用水配送。整个硬件系统应采取低功耗设计，且供电方式灵活，方便用户安装和更换。','7'),(206,'','2019KSZ07064',-4,2,200831010056,'2020-11-01 00:00:00',3000,'罗克韦尔实验室',2,'有相关论文和专利发表',NULL,NULL,NULL,5,400,'相关设备仪器：DF1731双通道直流稳压电源；GDP-3303多路直流稳压电源；VC830L手持式万用表等。\n教学资料：数字电路相关书籍、模拟电路相关书籍，以及相关编程语言的书籍等。\n还有其他实验室配套设施。\n','基于ROS-Unity3D的移动机器人 虚实交互场景构建方法的研究','2019-12-19 15:55:14','2019-12-05 00:00:00','明理楼A204',6,'2019-12-20 14:19:52',2,'本项目本项目采用基于ROS系统的轮式移动机器人作为控制对象模型，通过融合同时定位与建图技术(SLAM)以及ROS系统的相关算法包使机器人完整、有效地感知周围环境。定位与建图技术(SLAM)的基本思想是通过机器人如激光扫描仪、摄像头等传感器获取的点云数据、深度图像等数据，在其移动过程中建立出测试环境的二维地图模型。在此基础之上，将ROS系统与Unity3D系统进行连接，实现数据互通，使用Unity3D对其进行场景三维复杂化，进一步提升整个虚实交互场景的真实性、准确性，并且进一步提高虚实交互的灵活性。','7'),(207,'','2019KSZ06079',0,2,200831010051,'2020-11-01 00:00:00',3000,'罗克韦尔实验室',2,'有相关论文和专利发表',NULL,NULL,NULL,4,400,'相关设备仪器：DF1731双通道直流稳压电源；GDP-3303多路直流稳压电源；VC830L手持式万用表等。\n教学资料：数字电路相关书籍、模拟电路相关书籍，以及相关编程语言的书籍等。\n还有其他实验室配套设施。\n','test','2019-12-19 16:03:42','2019-12-05 00:00:00','明理楼A204',6,'2019-12-19 16:26:08',2,'本项目研究目的是结合ROS与激光slam技术，让现代物流机器人能够具备：状态感知（机器人自身和周边的状态）、实时决策（在特定场景下应该如何动作）、准确执行（按照决策的结果和任务能够做出精确的动作）。让物联网技术、人工智能技术和机器人技术在物流领域得到发展，让数据能自由流动、算法指挥硬件能发挥出最大的性能。','6'),(208,'','2019KSZ07065',-2,2,200531010051,'2020-11-01 00:00:00',3000,'罗克韦尔实验室',2,'有相关论文和专利发表',NULL,NULL,NULL,4,400,'相关设备仪器：DF1731双通道直流稳压电源；GDP-3303多路直流稳压电源；VC830L手持式万用表等。\n教学资料：数字电路相关书籍、模拟电路相关书籍，以及相关编程语言的书籍等。\n还有其他实验室配套设施。\n','基于ROS的slam定位智能物流小车的研究','2019-12-19 16:22:32','2019-12-05 00:00:00','明理楼A204',6,'2019-12-24 15:33:59',2,'本项目研究目的是结合ROS与激光slam技术，让现代物流机器人能够具备：状态感知（机器人自身和周边的状态）、实时决策（在特定场景下应该如何动作）、准确执行（按照决策的结果和任务能够做出精确的动作）。让物联网技术、人工智能技术和机器人技术在物流领域得到发展，让数据能自由流动、算法指挥硬件能发挥出最大的性能。','7'),(217,'','2019KSZ07066',-2,1,201799010032,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开发实验报告、作品、竞赛获奖','[\"7\"]','[\"30\",\"31\",\"32\",\"33\"]',NULL,3,60,'示波器、直流电源、雕刻机等','基于摄像头的室外跟随机器车','2019-12-19 16:56:55','2019-12-05 00:00:00','明理楼C205',6,'2019-12-24 15:58:45',2,'设计并制作一款机器车，在室外环境下，利用摄像头采集图像信息并进行人体识别，并实现人车跟随。','7'),(219,'','2019KSZ07067',-2,1,201799010032,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放实验报告、作品、学科竞赛获奖。',NULL,NULL,NULL,3,60,'示波器、万用表、雕刻机、电源等。','基于摄像头的寻迹智能车','2019-12-19 17:04:30','2019-12-05 00:00:00','明理楼C205',6,'2019-12-24 16:13:46',2,'设一款利用摄像头进行寻迹的智能小车。','7'),(220,'','2019KSZ07068',-4,2,201599010098,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'结题报告一份；实验研究报告一份；发表论文或参加竞赛获奖。','[\"7\"]','[]',NULL,5,7200,'该实验室具备常用的仪器设备及项目需要的理论知识储备。','基于神经网络的车间安全行为之安全帽佩戴检测系统','2019-12-19 17:04:35','2019-12-05 00:00:00','明理楼A311',6,'2019-12-20 14:17:46',2,'本题着力于生产环境的安全行为，通过摄像头采集并识别职工在生产车间是\n否佩戴安全帽的图像数据，开发一个车间安全帽检测系统。企业提供 7581 张含\n有佩戴安全帽的图片，并对该数据进行了预标注，选手可以自行对数据进行清洗，\n分成训练集与测试集，以及自行扩充数据集（需提供数据来源）。','7'),(221,'2019KSP07028','2019KSZ07069',4,1,201799010032,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'开放实验报告、作品、竞赛获奖。','[\"7\"]',NULL,NULL,4,60,'电源、示波器、雕刻机等','平衡自行车机器人设计','2019-12-19 17:07:16','2019-12-05 00:00:00','明理楼C205',6,'2019-12-25 17:40:19',2,'设计一款能够自主运行的平衡自行车机器人。','7'),(222,'','2019KSZ07070',-4,2,200731010110,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'实物作品、实验指导书、实验报告、相关论文','[\"7\"]',NULL,'[2017,2016,2018]',5,120,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','电子类专业大学生创新实践实验系统的设计与开发','2019-12-20 14:12:26','2019-12-05 00:00:00','明理楼A305',6,'2019-12-20 14:17:19',1,'电子类专业学生的创新实践能力培养目标需要大量的实践操作和相关技能训练才能达成。本开放实验课题需要学生根据相关要求，设计开发一套适用于电子类专业学生创新实践训练、学科竞赛、课程设计、毕业设计的电路实验装置。该装置采用模块化设计，具有电源、微控制器、显示屏、键盘、通信接口、ADDA转换、信号发生、信号检测、放大器、滤波器等常用信号处理及控制模块，模块可独立使用，也可以通过合理组合，搭建一套具有完整功能的电路系统。建议大二及以上学生，尤其是经常参加学科竞赛和其它创新实践活动的同学选题。','7'),(223,'2019KSP07029','2019KSZ07071',4,1,200731010110,'2020-06-01 00:00:00',500,'电工与电气信息实验教学中心',2,'实验报告、实物作品','[\"7\"]',NULL,NULL,3,60,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','DDS信号发生器的设计与制作','2019-12-20 14:14:25','2019-12-05 00:00:00','明理楼A305',6,'2019-12-25 17:40:19',1,'利用DDS芯片设计和制作一款具有多种函数波形输出能力的信号发生器，可输出正弦波、三角波、锯齿波等，输出频率在1Hz~1MHz范围内连续可调。推荐大二或更高年级同学选题。','7'),(224,'','2019KSZ07072',-4,2,201899010089,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'开放性实验报告、作品、比赛获奖','[\"7\"]',NULL,NULL,3,120,'实验室具备完成开发实验所需工具、器材、仪器及相关场地','解魔方机器人的设计','2019-12-20 14:43:36','2019-12-05 00:00:00','明理楼A202',6,'2019-12-20 14:47:05',1,'近年来智能机器人逐渐走进人们的日常生产和生活，而解魔方机器人因其无与伦比的趣味性和交互性，正成为人工智能的研究热点。解魔方机器人是集机器人视觉、机器人控制技术、图像处理、虚拟现实交互、魔方还原算法等多学科知识于一体的综合性机器人，对促进机器人的智能化发展具有重要的科学意义和研究价值。','7'),(225,'','2019KSZ07073',1,2,199831010014,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',1,'发表论文，程序开发','[\"7\",\"6\",\"10\",\"9\"]',NULL,'[2016,2017,2018]',3,120,'中心配备满足开放实验所需的各种实验仪器设备、必要的工具以及满足相关要求和安全条件的实验场地，有专人负责开放实验期间的学生管理以及指导工作，具备进行开放实验的各种条件。','某城市电动网约车和出租车充电需求预测','2019-12-20 14:52:15','2019-12-05 00:00:00','明理楼A206',6,'2019-12-20 14:53:08',1,'1、对城市道路建立路网模型，要求包括一系列道路状况参数；\n2、分析电动出租车行驶行为；\n3、分析电动网约车行驶行为；\n4、计算不同类型车辆在路网中的点充电需求；\n5、分析分时电价对充电负荷时空分布的影响。\n发表论文\n','7'),(226,'','2019KSZ07074',-4,2,201031010042,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',2,'开放实验报告，专利/论文/学科竞赛省三等以上中任何一项。',NULL,NULL,NULL,5,120,'实验室具备完成开放实验所需工具、器材、仪器及相关场地','便携式红外瓦斯浓度检测装置的开发','2019-12-20 17:56:57','2019-12-05 00:00:00','明理楼A307',6,'2019-12-20 17:58:32',2,'本项目研究的便携式红外瓦斯浓度检测装置是以红外吸收原理、朗伯-比尔定律理论为基础的用于测量是否发生瓦斯泄漏以及其泄漏浓度的一种便携式检测仪器。本项目研究设计的仪器工作原理主要是光源发出的红外光在气室中经过两片滤光片后被红外探测器检测，探测器将光源信号转换为电信号并将所得电信号通过信号滤波、信号放大等信号处理电路后送入数据处理器中进行分析，随后将分析所得结果通过显示模块进行显示，以便于工作人员能非常便捷地知晓是否发生瓦斯泄漏以及其泄漏浓度。','7'),(239,'','2019KSZ07075',1,2,201699010069,'2020-11-01 00:00:00',3000,'电工与电气信息实验教学中心',3,'申请发明专利一项；录用或发表期刊论文一篇；研究报告一份。',NULL,NULL,NULL,3,120,'高电压技术实验室，MATLAB, Aspen Hysys, pipeline studio软件','海上油气平台群混合储能系统设计与优化运行','2019-12-20 18:44:17','2019-12-05 00:00:00','明理楼C410',6,'2019-12-23 08:36:22',2,'以陆上压缩天然气储能和压缩空气储能模型为依托，结合海上石油开采的特点，利用枯竭的油气井建立伴生气储库模型。构建储电、储气二者联合的混合储能系统，并对其进行设计优化，提高海上油气平台群运行的经济性和环保性。主要研究内容为：（1）研究伴生气储库特性，主要是包括伴生气储库的结构和工作原理，以及适用场景分析。 （2）在目前海上平台储能系统的发展现状基础上，利用伴生气储库的特性，提出电-气混合储能系统的构建方案，为后面混合储能系统的优化运行提供理论依据。 （3）为了进一步实现在混合储能系统在海上平台群的应用，提出考虑经济性与环保性约束条件的混合储能系统优化运行策略，通过协调储电系统、伴生气储库二者的运行，降低海上油气平台的生产成本和二氧化碳排放量。 ','7'),(240,'','2019KSZ07076',1,2,201799010032,'2020-11-01 00:00:00',5000,'电工与电信信息实验室中心',1,'开放性实验报告、作品、论文或专利或学科竞赛获奖。','[\"7\"]',NULL,NULL,5,150,'示波器、直流电源、雕刻机、3D打印机等。','基于GPS及IMU的车载组合定位方法研究','2019-12-23 09:11:50','2019-12-05 00:00:00','明理楼C205',6,'2019-12-23 09:32:50',2,'设计一款能够采集GPS、IMU、OBD信息的电路装置、利用上述信息，研究数据融合算法，提取出最佳的车载定位信息。','7'),(241,'2019KSP07030','2019KSZ07077',4,1,201799010032,'2020-06-01 00:00:00',500,'电工与电信信息实验室中心',2,'  开放实验报告、作品、学科竞赛获奖','[\"7\"]',NULL,NULL,3,60,'示波器、万用表、雕刻机、电源等。','基于摄像头的寻迹智能车','2019-12-24 16:06:57','2019-12-05 00:00:00','明理楼C205',6,'2019-12-25 17:40:19',1,'设一款利用摄像头进行寻迹的智能小车。','7'),(242,'','2019KSZ07078',1,1,201899010010,'2020-06-01 00:00:00',500,'电信院普通项目测试勿选',1,'电信院普通项目测试勿选',NULL,NULL,NULL,3,300,'电信院普通项目测试勿选','电信院普通项目测试勿选','2019-12-25 09:50:08','2019-12-05 00:00:00','电信院普通项目测试勿选',6,'2019-12-25 09:52:04',1,'电信院普通项目测试勿选','7'),(243,'','2019KSZ07079',-4,2,201731011111,'2020-06-01 00:00:00',500,'1',1,'1',NULL,NULL,NULL,5,200,'1','1','2019-12-25 20:46:07','2019-12-05 00:00:00','1',1,'2019-12-25 20:48:16',2,'1','7');
